/****** Object:  UserDefinedFunction [dbo].[iter$simple_intlist_to_tbl]    Script Date: 12/16/2024 6:29:43 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE  function [dbo].[iter$simple_intlist_to_tbl] (@list NVARCHAR(MAX))
RETURNS @tbl TABLE (number INT NOT NULL)
AS
BEGIN
	DECLARE @pos INT
		,@nextpos INT
		,@valuelen INT

	SELECT @pos = 0
		,@nextpos = 1

	IF CHARINDEX(',', @list) > 0
		BEGIN
		WHILE @nextpos > 0
		BEGIN
			SELECT @nextpos = charindex(',', @list, @pos + 1)

			SELECT @valuelen = CASE WHEN @nextpos > 0 THEN @nextpos ELSE len(@list) + 1 END - @pos - 1

			INSERT @tbl (number)
			VALUES (convert(INT, substring(@list, @pos + 1, @valuelen)))

			SELECT @pos = @nextpos
		END
	END
	ELSE
	Begin	
			INSERT @tbl (number)
			VALUES (convert(INT, RTRIM(LTRIM(@list))))
	END

	RETURN
END


GO
/****** Object:  UserDefinedFunction [dbo].[KeepBengaliAndSpaces]    Script Date: 12/16/2024 6:29:43 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[KeepBengaliAndSpaces] (@input NVARCHAR(MAX))
RETURNS NVARCHAR(MAX)
AS
BEGIN
    DECLARE @output NVARCHAR(MAX) = '';
    DECLARE @char NVARCHAR(1);
    DECLARE @i INT = 1;
    DECLARE @len INT = LEN(@input);

    WHILE @i <= @len
    BEGIN
        SET @char = SUBSTRING(@input, @i, 1);

        -- Keep Bengali characters (Unicode U+0980 to U+09FF) and spaces (U+0020)
        IF (UNICODE(@char) BETWEEN 0x0980 AND 0x09FF) OR UNICODE(@char) = 0x0020
        BEGIN
            SET @output = @output + @char;
        END
        
        SET @i = @i + 1;
    END

    RETURN @output;
END;
GO
