	,@PadWith nvarchar(255)
	,@PadLen int
	,@InputStr nvarchar(max)
	,@Surfix nvarchar(20) 
	)
RETURNS nvarchar(255) 
AS
BEGIN
	--RETURN IsNull(@Prefix,'') + right(replicate(@PadWith, @PadLen) + @InputStr, @PadLen) + IsNull(@Surfix,'')
