/****** Object:  UserDefinedFunction [dbo].[Split]    Script Date: 12/16/2024 6:29:43 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- select * From Split('1,2,3', ',')
CREATE  function [dbo].[Split] (
	@String NVARCHAR(max)
	,@Delimiter CHAR(1)
	)
RETURNS @Results TABLE (Items NVARCHAR(max))
AS
BEGIN
	DECLARE @index INT
	DECLARE @slice NVARCHAR(4000)

	SELECT @index = 1

	IF @String IS NULL
		RETURN

	WHILE @index != 0
	BEGIN
		SELECT @index = charindex(@Delimiter, @String)

		IF @index != 0
			SELECT @slice = left(@String, @index - 1)
		ELSE
			SELECT @slice = @String

		INSERT INTO @Results (Items)
		VALUES (@slice)

		SELECT @String = right(@String, len(@String) - @index)

		IF len(@String) = 0
			BREAK
	END

	RETURN
END


GO
