/*
[_______KAFProcess_OwinUserRoleUpdForAllRole] 
@RoleIDs=NULL,
@UpdatedByUserName='Admin',
@UpdatedDate='2022-07-24',
@TransID=14
*/

CREATE PROCEDURE [dbo].[_______KAFProcess_OwinUserRoleUpdForAllRole] @RoleIDs           NVARCHAR(250)  = NULL, 
                                                                    @RoleName          NVARCHAR(250)  = NULL, 
                                                                    @Description       NVARCHAR(500)  = NULL, 
                                                                    @Ex_Date1          DATETIME       = NULL, 
                                                                    @Ex_Date2          DATETIME       = NULL, 
                                                                    @Ex_Nvarchar1      NVARCHAR(250)  = NULL, 
                                                                    @Ex_Nvarchar2      NVARCHAR(250)  = NULL, 
                                                                    @Ex_Bigint1        BIGINT         = NULL, 
                                                                    @Ex_Bigint2        BIGINT         = NULL, 
                                                                    @Ex_Decimal1       DECIMAL(18, 2)  = NULL, 
                                                                    @Ex_Decimal2       DECIMAL(18, 2)  = NULL, 
                                                                    @RETURN_KEY        BIGINT         = NULL OUTPUT,
                                                                    --@CreatedBy           BIGINT         = NULL,
                                                                    @CreatedByUserName NVARCHAR(256)  = NULL,
                                                                    --@UpdatedBy           BIGINT,
                                                                    @UpdatedByUserName NVARCHAR(256), 
                                                                    @CreatedDate       DATETIME       = NULL, 
                                                                    @UpdatedDate       DATETIME,
                                                                    --@FormID              BIGINT,
                                                                    @IPAddress         NVARCHAR(150)   = NULL, 
                                                                    @TransID           NVARCHAR(250),
                                                                    --@UserOrganizationKey BIGINT,
                                                                    --@UserEntityKey       BIGINT,
                                                                    @Ts                BIGINT         = NULL
AS
    BEGIN
        DECLARE @MyCursor CURSOR;
        DECLARE @MyField VARCHAR(50);
        BEGIN
            SET @MyCursor = CURSOR
            FOR SELECT RoleID
                FROM Owin_Role
                WHERE(CASE
                          WHEN @RoleIDs IS NULL
                          THEN 1
                          WHEN @RoleIDs IS NOT NULL
                               AND RoleID IN
                (
                    SELECT Items
                    FROM DBO.Split(@RoleIDs, ',')
                )
                          THEN 1
                          ELSE 0
                      END = 1);
            OPEN @MyCursor;
            FETCH NEXT FROM @MyCursor INTO @MyField;
            WHILE @@FETCH_STATUS = 0
                BEGIN

/*UPDATE Owin_Role
                       SET
                           RoleName = @RoleName,
                           Description = @Description,
                           Ex_Date1 = @Ex_Date1,
                           Ex_Date2 = @Ex_Date2,
                           Ex_Nvarchar1 = @Ex_Nvarchar1,
                           Ex_Nvarchar2 = @Ex_Nvarchar2,
                           Ex_Bigint1 = @Ex_Bigint1,
                           Ex_Bigint2 = @Ex_Bigint2,
                           Ex_Decimal1 = @Ex_Decimal1,
                           Ex_Decimal2 = @Ex_Decimal2,
                           TransID = @TransID,
                           UserOrganizationKey = @UserOrganizationKey,
                           UserEntityKey = @UserEntityKey,
                           UpdatedBy = @UpdatedBy,
                           UpdatedByUserName = @UpdatedByUserName,
                           UpdatedDate = @UpdatedDate,
                           IPAddress = @IPAddress,
                           FormID = @FormID
                     WHERE RoleID = @MyField;  
  
                     --SET @RETURN_KEY =@RoleID  
				 */

                    INSERT INTO Owin_RolePermission
                    (RoleID, 
                     FormActionID, 
                     AppFormID, 
                     STATUS,
                     --Ex_Date1,
                     --Ex_Date2,
                     --Ex_Nvarchar1,
                     --Ex_Nvarchar2,
                     --Ex_Bigint1,
                     --Ex_Bigint2,
                     --Ex_Decimal1,
                     --Ex_Decimal2,
                     TransID,
                     --UserOrganizationKey,
                     --UserEntityKey,
                     --CreatedBy,
                     CreatedByUserName, 
                     CreatedDate, 
                     IPAddress
                    --FormID
                    )
                           SELECT @MyField, 
                                  Owin_FormAction.FormActionID, 
                                  Owin_FormAction.AppFormID, 
                                  (CASE
                                       WHEN LTRIM(RTRIM(Owin_FormAction.Ex_Nvarchar2)) = LTRIM(RTRIM('Internal Method'))
                                       THEN 1
                                       ELSE 0
                                   END) AS STATUS, --Modified on 14th Oct 2019 & Requested By Eyasin ,  
                                  --@Ex_Date1,
                                  --@Ex_Date2,
                                  --@Ex_Nvarchar1,
                                  --@Ex_Nvarchar2,
                                  --@Ex_Bigint1,
                                  --@Ex_Bigint2,
                                  --@Ex_Decimal1,
                                  --@Ex_Decimal2,
                                  @TransID,
                                  --@UserOrganizationKey,
                                  --@UserEntityKey,
                                  --@CreatedBy,
                                  @CreatedByUserName, 
                                  @CreatedDate, 
                                  @IPAddress
                           --@FormID
                           FROM Owin_FormAction
                           WHERE Owin_FormAction.FormActionID NOT IN
                           (
                               SELECT Owin_RolePermission.FormActionID
                               FROM Owin_RolePermission
                               WHERE RoleID = @MyField
                           );
                    UPDATE Owin_RolePermission
                      SET 
                          STATUS = 1
                    WHERE FormActionID IN
                    (
                        SELECT FormActionID
                        FROM Owin_FormAction
                        WHERE LTRIM(RTRIM(Owin_FormAction.Ex_Nvarchar2)) = LTRIM(RTRIM('Internal Method'))
                    )
                          AND RoleID = @MyField;
                    FETCH NEXT FROM @MyCursor INTO @MyField;
                END;
            CLOSE @MyCursor;
            DEALLOCATE @MyCursor;
        END;
    END;
GO
