CREATE PROCEDURE [dbo].[_______MENUCREATER] 
				@AppFormID         BIGINT         = NULL, 
				@FormName          NVARCHAR(150)  = NULL, 
				@FormNameAr        NVARCHAR(150)  = NULL, 
				@ParentID          BIGINT         = NULL, 
				@LevelID           INT            = NULL, 
				@MenuLevel         NVARCHAR(50)   = NULL, 
				@HasDirectChild    BIT            = NULL, 
				@ActionURL         NVARCHAR(256), 
				@RoleID            BIGINT, 
				@FormActionName    NVARCHAR(MAX), 
				@FormDisplayName   NVARCHAR(MAX), 
				@OperationName     NVARCHAR(MAX), 
				@IsViewStatus      NVARCHAR(MAX), 
				@Icon              IMAGE          = NULL, 
				@ClassIcon         NVARCHAR(50)   = NULL, 
				@Sequence          INT            = NULL, 
				@URL               NVARCHAR(200)  = NULL, 
				@IsView            BIT            = NULL, 
				@IsDynamic         BIT            = NULL, 
				@IsSuperAdmin      BIT            = NULL, 
				@IsVisibleInMenu   BIT            = NULL, 
				@OrganizationKey   BIGINT         = NULL, 
				@Ex_Date1          DATETIME       = NULL, 
				@Ex_Date2          DATETIME       = NULL, 
				@Ex_Nvarchar1      NVARCHAR(250)  = NULL, 
				@Ex_Nvarchar2      NVARCHAR(250)  = NULL, 
				@Ex_Nvarchar3      NVARCHAR(250)  = NULL, 
				@Ex_Bigint1        BIGINT         = NULL, 
				@Ex_Bigint2        BIGINT         = NULL, 
				@Ex_Decimal1       DECIMAL(18, 2)  = NULL, 
				@Ex_Decimal2       DECIMAL(18, 2)  = NULL, 
				@RETURN_KEY        BIGINT         = NULL OUTPUT,
				--@CreatedBy bigint,
				@CreatedByUserName NVARCHAR(256)  = NULL,
				--@UpdatedBy bigint= NULL,
				@UpdatedByUserName NVARCHAR(256)  = NULL, 
				@CreatedDate       DATETIME, 
				@UpdatedDate       DATETIME       = NULL,
				--@FormID bigint = NULL,
				@IPAddress         NVARCHAR(150)  = NULL, 
				@TransID           NVARCHAR(250),
				@Ts                BIGINT         = NULL
AS
    BEGIN
        SET @Sequence =
        (
            SELECT TOP 1 [Sequence]
            FROM [Owin_FormInfo]
            WHERE ParentID = 1--ISNULL(@ParentID,0)
            ORDER BY [Sequence] DESC
        );
        IF @Sequence IS NULL
            BEGIN
                SET @Sequence = 1;
        END;
            ELSE
            BEGIN
                SET @Sequence = @Sequence + 1;
        END;
        IF @FormName IS NOT NULL
           AND @AppFormID IS NULL
            BEGIN
                INSERT INTO [dbo].[owin_forminfo]
                ([formname], 
                 [parentid], 
                 [levelid], 
                 [menulevel], 
                 [formnamear], 
                 [hasdirectchild], 
                 [icon], 
                 [classicon], 
                 [sequence], 
                 [url], 
                 [isview], 
                 [isdynamic], 
                 [issuperadmin], 
                 [isvisibleinmenu], 
                 [organizationkey], 
                 [ex_date1], 
                 [ex_date2], 
                 [ex_nvarchar1], 
                 [ex_nvarchar2], 
                 [ex_bigint1], 
                 [ex_bigint2], 
                 [ex_decimal1], 
                 [ex_decimal2], 
                 [transid], 
                 --[userorganizationkey], 
                 --[userentitykey], 
                 --[createdby], 
                 [createdbyusername], 
                 [createddate], 
                 --[updatedby], 
                 [updatedbyusername], 
                 [updateddate], 
                 [ipaddress] 
                --[formid]
                )
                VALUES
                (@FormName, 
                 @ParentID, 
                 @LevelID,
                 CASE
                     WHEN @LevelID = 1
                     THEN '1'
                     WHEN @LevelID = 2
                     THEN '1.1'
                     WHEN @LevelID = 3
                     THEN '1.1.1'
                     ELSE '1.1.1.1'
                 END, --@MenuLevel, 
                 ISNULL(@FormNameAr, @FormName), 
                 @HasDirectChild, 
                 @Icon, 
                 @ClassIcon, 
                 @Sequence, 
                 NULL, --REPLACE(@FormName,' ','')+'/', 
                 1, --@IsView, 
                 @IsDynamic, 
                 1, --@IsSuperAdmin, 
                 1, --@IsVisibleInMenu, 
                 @OrganizationKey, 
                 @Ex_Date1, 
                 @Ex_Date2, 
                 @Ex_Nvarchar1, 
                 @Ex_Nvarchar2, 
                 @Ex_Bigint1, 
                 @Ex_Bigint2, 
                 @Ex_Decimal1, 
                 @Ex_Decimal2, 
                 @TransID, 
                 --@UserOrganizationKey, 
                 --@UserEntityKey, 
                 --@CreatedBy, 
                 @CreatedByUserName, 
                 @CreatedDate, 
                 --@UpdatedBy, 
                 @UpdatedByUserName, 
                 @UpdatedDate, 
                 @IPAddress 
                --@FormID
                );
                SET @RETURN_KEY = SCOPE_IDENTITY();
        END;
            ELSE
            IF @FormName IS NULL
               AND @AppFormID IS NOT NULL
                BEGIN
                    SET @RETURN_KEY = @AppFormID;
            END;

        --------------------------------------- 
        DECLARE @i AS INT= 0;
        DECLARE @RowCount AS INT= 0;
        DECLARE @vFormActionName AS NVARCHAR(MAX), @vFormDisplayName AS NVARCHAR(MAX), @vOperationName AS NVARCHAR(MAX), @vIsViewStatus AS NVARCHAR(MAX);
        DECLARE @FormActionID BIGINT;
        SET @RowCount = LEN(@FormActionName) - LEN(Replace(@FormActionName, ',', ''));
        WHILE(@i <= @RowCount)
            BEGIN
                SELECT @vFormActionName = CAST(LEFT(@FormActionName, CHARINDEX(',', @FormActionName + ',', 0) - 1) AS NVARCHAR(MAX));
                SELECT @vFormDisplayName = CAST(LEFT(@FormDisplayName, CHARINDEX(',', @FormDisplayName + ',', 0) - 1) AS NVARCHAR(MAX));
                SELECT @vOperationName = CAST(LEFT(@OperationName, CHARINDEX(',', @OperationName + ',', 0) - 1) AS NVARCHAR(MAX));
                SELECT @vIsViewStatus = CAST(LEFT(@IsViewStatus, CHARINDEX(',', @IsViewStatus + ',', 0) - 1) AS NVARCHAR(MAX));
                SET @FormActionName = STUFF(@FormActionName, 1, CHARINDEX(',', @FormActionName, 0), '');
                SET @FormDisplayName = STUFF(@FormDisplayName, 1, CHARINDEX(',', @FormDisplayName, 0), '');
                SET @OperationName = STUFF(@OperationName, 1, CHARINDEX(',', @OperationName, 0), '');
                SET @IsViewStatus = STUFF(@IsViewStatus, 1, CHARINDEX(',', @IsViewStatus, 0), '');

                --Set @AppFormID=(Select AppFormID from Owin_FormAction 
                --     Where FormActionID =@vFormActionName) 
                INSERT INTO [dbo].[owin_formaction]
                ([appformid], 
                 [actionname], 
                 EventName, 
                 DisplayNameAr, 
                 DisplayName, 
                 MethodType, 
                 [isview], 
                 [ex_date1], 
                 [ex_date2], 
                 [ex_nvarchar1], 
                 [ex_nvarchar2], 
                 Ex_Nvarchar3, 
                 [ex_bigint1], 
                 [ex_bigint2], 
                 [ex_decimal1], 
                 [ex_decimal2], 
                 [transid], 
                 --[userorganizationkey], 
                 --[userentitykey], 
                 --[createdby], 
                 [createdbyusername], 
                 [createddate], 
                 --[updatedby], 
                 [updatedbyusername], 
                 [updateddate], 
                 [ipaddress]
                --[formid]
                )
                VALUES
                (@RETURN_KEY, 
                 @ActionURL + '/' + @vFormActionName, --@ActionURL+'/'+REPLACE (@vFormActionName, ' ', '' ), 
                 @vOperationName, --EventName,
                 @vFormDisplayName, --DisplayNameAr,
                 @vFormDisplayName, --DisplayName,
                 NULL, --MethodType,
                 @vIsViewStatus, 
                 @Ex_Date1, 
                 @Ex_Date2, 
                 @Ex_Nvarchar1, 
                 @Ex_Nvarchar2, 
                 @Ex_Nvarchar3, 
                 @Ex_Bigint1, 
                 @Ex_Bigint2, 
                 @Ex_Decimal1, 
                 @Ex_Decimal2, 
                 14, 
                 --14, 
                 --1, 
                 --@CreatedBy, 
                 @CreatedByUserName, 
                 @CreatedDate, 
                 --@UpdatedBy, 
                 @UpdatedByUserName, 
                 @UpdatedDate, 
                 @IPAddress
                --@FormID
                );
                SET @FormActionID = SCOPE_IDENTITY();
                INSERT INTO owin_rolepermission
                (roleid, 
                 formactionid, 
                 appformid, 
                 STATUS, 
                 --ex_date1, 
                 --ex_date2, 
                 --ex_nvarchar1, 
                 --ex_nvarchar2, 
                 --ex_bigint1, 
                 --ex_bigint2, 
                 --ex_decimal1, 
                 --ex_decimal2, 
                 transid, 
                 --userorganizationkey, 
                 --userentitykey, 
                 --createdby, 
                 createdbyusername, 
                 createddate, 
                 ipaddress 
                --formid
                )
                       SELECT @RoleID, 
                              formactionid, 
                              appformid, 
                              --(CASE WHEN @vOperationName='Internal Method' THEN 1 ELSE 0 END),--1, 
                              (CASE
                                   WHEN @vIsViewStatus = 1
                                   THEN 1
                                   ELSE 0
                               END), --1, 
                              --@Ex_Date1, 
                              --@Ex_Date2, 
                              --@Ex_Nvarchar1, 
                              --@Ex_Nvarchar2, 
                              --@Ex_Bigint1, 
                              --@Ex_Bigint2, 
                              --@Ex_Decimal1, 
                              --@Ex_Decimal2, 
                              @TransID, 
                              --@UserOrganizationKey, 
                              --@UserEntityKey, 
                              --@CreatedBy, 
                              @CreatedByUserName, 
                              @CreatedDate, 
                              @IPAddress
                       --@FormID 
                       FROM [dbo].[owin_formaction]
                       WHERE FormActionID = @FormActionID;
                SET @i = @i + 1;
            END;

                --------------------------------------- 

    END;
GO
