CREATE PROCEDURE [dbo].[____NEW__CORE___MENUCREATER]

		@ActionName nvarchar (150),
		@TableName nvarchar (150),
	    @ActionNameAR nvarchar (150) = NULL,
		@AppFormID bigint  = NULL
AS
	
     BEGIN 
	 declare @TAppFormID bigint
	 set @TAppFormID = -99
	 if exists(select ClassIcon from Owin_FormAction where ClassIcon = @TableName)
	 Begin
		print 'menu exists'
	 End
