--[dbo].[__OwinUserCreation] @MasterUserID =122, @UserName     ='mroyontest@gmail.com'

CREATE PROCEDURE [dbo].[__OwinUserCreation] @MasterUserID BIGINT, 
                                            @UserName     NVARCHAR(50)
AS
    BEGIN
        DECLARE @Owin_User TABLE
        (MasterUserID    BIGINT, 
         OldMasterUserID BIGINT, 
         UserID          UNIQUEIDENTIFIER
        );
        INSERT INTO [dbo].[Owin_User]
        ([ApplicationId], 
         [UserId], 
         [UserName], 
         [EmailAddress], 
         [LoweredUserName], 
         [MobileNumber], 
         [UserProfilePhoto], 
         [IsAnonymous], 
         [IsChildEnable], 
         [MasPrivateKey], 
         [MasPublicKey], 
         [Password], 
         [PasswordSalt], 
         [PasswordKey], 
         [PasswordVector], 
         [MobilePIN], 
         [PasswordQuestion], 
         [PasswordAnswer], 
         [Approved], 
         [Locked], 
         [LastLoginDate], 
         [LastPassChangedDate], 
         [LastLockoutDate], 
         [FailedPasswordAttemptCount], 
         [Comment], 
         [LastActivityDate], 
         [IsReviewed], 
         [ReviewedBy], 
         [ReviewedByUserName], 
         [ReviewedDate], 
         [IsApproved], 
         [ApprovedBy], 
         [ApprovedByUserName], 
         [ApprovedDate], 
         [TransID], 
         [CreatedByUserName], 
         [CreatedDate], 
         [UpdatedByUserName], 
         [UpdatedDate], 
         [IPAddress]
        )
        OUTPUT INSERTED.MasterUserID, 
               INSERTED.ReviewedBy, 
               INSERTED.UserId
               INTO @Owin_User(MasterUserID, 
                               OldMasterUserID, 
                               UserID)
               SELECT ApplicationId, 
                      NEWID(), --UserId, 
                      @UserName, --UserName, 
                      @UserName + '@kuwaitarmy.gov.kw', --EmailAddress, 
                      @UserName + '@kuwaitarmy.gov.kw', --LoweredUserName, 
                      '22222222', --MobileNumber, 
                      UserProfilePhoto, 
                      IsAnonymous, 
                      IsChildEnable, 
                      MasPrivateKey, 
                      MasPublicKey, 
                      Password, 
                      PasswordSalt, 
                      PasswordKey, 
                      PasswordVector, 
                      MobilePIN, 
                      PasswordQuestion, 
                      PasswordAnswer, 
                      Approved, 
                      Locked, 
                      LastLoginDate, 
                      LastPassChangedDate, 
                      LastLockoutDate, 
                      FailedPasswordAttemptCount, 
                      Comment, 
                      LastActivityDate, 
                      IsReviewed, 
                      MasterUserID, --ReviewedBy, 
                      ReviewedByUserName, 
                      ReviewedDate, 
                      IsApproved, 
                      ApprovedBy, 
                      ApprovedByUserName, 
                      ApprovedDate, 
                      TransID, 
                      CreatedByUserName, 
                      CreatedDate, 
                      UpdatedByUserName, 
                      UpdatedDate, 
                      IPAddress
               FROM Owin_User
               WHERE MasterUserID = 122;
        INSERT INTO [dbo].[Owin_UserRole]
        ([UserID], 
         [MasterUserID], 
         [RoleID], 
         [IsEnable], 
         [TransID], 
         [CreatedByUserName], 
         [CreatedDate], 
         [UpdatedByUserName], 
         [UpdatedDate], 
         [IPAddress]
        )
               SELECT NewOwin_User.UserID, 
                      NewOwin_User.MasterUserID, 
                      [RoleID], 
                      [IsEnable], 
                      [TransID], 
                      [CreatedByUserName], 
                      [CreatedDate], 
                      [UpdatedByUserName], 
                      [UpdatedDate], 
                      [IPAddress]
               FROM [dbo].[Owin_UserRole]
                    INNER JOIN @Owin_User AS NewOwin_User ON [Owin_UserRole].MasterUserID = NewOwin_User.OldMasterUserID;
    END;
GO
