--GET ALL
CREATE PROCEDURE [dbo].[gen_eventcategory_GA] 
		@EventCategoryID bigint  = NULL,
		@EventCategory nvarchar (500) = NULL,
		@Description nvarchar (MAX) = NULL,
		@Ex_Date1 datetime  = NULL,
		@Ex_Date2 datetime  = NULL,
		@Ex_Nvarchar1 nvarchar (250) = NULL,
		@Ex_Nvarchar2 nvarchar (250) = NULL,
		@Ex_Nvarchar3 nvarchar (250) = NULL,
		@Ex_Bigint1 bigint  = NULL,
		@Ex_Bigint2 bigint  = NULL,
		@Ex_Decimal1 decimal (18, 2) = NULL,
		@Ex_Decimal2 decimal (18, 2) = NULL,
		    
        @SortExpression VARCHAR(MAX)  = NULL,
        @CreatedByUserName nvarchar(256),
        @UpdatedByUserName nvarchar(256)= NULL,
        @CreatedDate DATETIME,
        @UpdatedDate DATETIME= NULL,
        @IPAddress varchar(100)= NULL,
        @TransID nvarchar(250) ,
        @Ts bigint = NULL
        
	AS
	BEGIN
		SELECT 
			Gen_EventCategory.EventCategoryID,
			Gen_EventCategory.EventCategory,
			Gen_EventCategory.Description,
			Gen_EventCategory.Ex_Date1,
			Gen_EventCategory.Ex_Date2,
			Gen_EventCategory.Ex_Nvarchar1,
			Gen_EventCategory.Ex_Nvarchar2,
			Gen_EventCategory.Ex_Nvarchar3,
			Gen_EventCategory.Ex_Bigint1,
			Gen_EventCategory.Ex_Bigint2,
			Gen_EventCategory.Ex_Decimal1,
			Gen_EventCategory.Ex_Decimal2,
			Gen_EventCategory.TransID,
			Gen_EventCategory.CreatedByUserName,
			Gen_EventCategory.CreatedDate,
			Gen_EventCategory.UpdatedByUserName,
			Gen_EventCategory.UpdatedDate,
			Gen_EventCategory.IPAddress,
			CONVERT(bigint, TS) as TS
			,ROW_NUMBER() OVER
				(
					ORDER BY
						CASE WHEN @SortExpression ='EventCategoryID ASC' THEN Gen_EventCategory.EventCategoryID END ASC,
						CASE WHEN @SortExpression ='EventCategoryID DESC' THEN Gen_EventCategory.EventCategoryID END DESC,
						CASE WHEN @SortExpression ='Description ASC' THEN Gen_EventCategory.Description END ASC,
						CASE WHEN @SortExpression ='Description DESC' THEN Gen_EventCategory.Description END DESC,
						CASE WHEN @SortExpression ='Ex_Date1 ASC' THEN Gen_EventCategory.Ex_Date1 END ASC,
						CASE WHEN @SortExpression ='Ex_Date1 DESC' THEN Gen_EventCategory.Ex_Date1 END DESC,
						CASE WHEN @SortExpression ='Ex_Date2 ASC' THEN Gen_EventCategory.Ex_Date2 END ASC,
						CASE WHEN @SortExpression ='Ex_Date2 DESC' THEN Gen_EventCategory.Ex_Date2 END DESC,
						CASE WHEN @SortExpression ='Ex_Nvarchar1 ASC' THEN Gen_EventCategory.Ex_Nvarchar1 END ASC,
						CASE WHEN @SortExpression ='Ex_Nvarchar1 DESC' THEN Gen_EventCategory.Ex_Nvarchar1 END DESC,
						CASE WHEN @SortExpression ='Ex_Nvarchar2 ASC' THEN Gen_EventCategory.Ex_Nvarchar2 END ASC,
						CASE WHEN @SortExpression ='Ex_Nvarchar2 DESC' THEN Gen_EventCategory.Ex_Nvarchar2 END DESC,
						CASE WHEN @SortExpression ='Ex_Nvarchar3 ASC' THEN Gen_EventCategory.Ex_Nvarchar3 END ASC,
						CASE WHEN @SortExpression ='Ex_Nvarchar3 DESC' THEN Gen_EventCategory.Ex_Nvarchar3 END DESC,
						CASE WHEN @SortExpression ='Ex_Bigint1 ASC' THEN Gen_EventCategory.Ex_Bigint1 END ASC,
						CASE WHEN @SortExpression ='Ex_Bigint1 DESC' THEN Gen_EventCategory.Ex_Bigint1 END DESC,
						CASE WHEN @SortExpression ='Ex_Bigint2 ASC' THEN Gen_EventCategory.Ex_Bigint2 END ASC,
						CASE WHEN @SortExpression ='Ex_Bigint2 DESC' THEN Gen_EventCategory.Ex_Bigint2 END DESC,
						CASE WHEN @SortExpression ='Ex_Decimal1 ASC' THEN Gen_EventCategory.Ex_Decimal1 END ASC,
						CASE WHEN @SortExpression ='Ex_Decimal1 DESC' THEN Gen_EventCategory.Ex_Decimal1 END DESC,
						CASE WHEN @SortExpression ='Ex_Decimal2 ASC' THEN Gen_EventCategory.Ex_Decimal2 END ASC,
						CASE WHEN @SortExpression ='Ex_Decimal2 DESC' THEN Gen_EventCategory.Ex_Decimal2 END DESC,
						CASE WHEN @SortExpression ='TransID ASC' THEN Gen_EventCategory.TransID END ASC,
						CASE WHEN @SortExpression ='TransID DESC' THEN Gen_EventCategory.TransID END DESC,
						CASE WHEN @SortExpression ='CreatedByUserName ASC' THEN Gen_EventCategory.CreatedByUserName END ASC,
						CASE WHEN @SortExpression ='CreatedByUserName DESC' THEN Gen_EventCategory.CreatedByUserName END DESC,
						CASE WHEN @SortExpression ='CreatedDate ASC' THEN Gen_EventCategory.CreatedDate END ASC,
						CASE WHEN @SortExpression ='CreatedDate DESC' THEN Gen_EventCategory.CreatedDate END DESC,
						CASE WHEN @SortExpression ='UpdatedByUserName ASC' THEN Gen_EventCategory.UpdatedByUserName END ASC,
						CASE WHEN @SortExpression ='UpdatedByUserName DESC' THEN Gen_EventCategory.UpdatedByUserName END DESC,
						CASE WHEN @SortExpression ='UpdatedDate ASC' THEN Gen_EventCategory.UpdatedDate END ASC,
						CASE WHEN @SortExpression ='UpdatedDate DESC' THEN Gen_EventCategory.UpdatedDate END DESC,
						CASE WHEN @SortExpression ='IPAddress ASC' THEN Gen_EventCategory.IPAddress END ASC,
						CASE WHEN @SortExpression ='IPAddress DESC' THEN Gen_EventCategory.IPAddress END DESC
				) as RowNumber
		FROM Gen_EventCategory 
		where
			(CASE WHEN @EventCategoryID is NULL THEN 1 WHEN Gen_EventCategory.EventCategoryID  = @EventCategoryID THEN 1 ELSE 0 END = 1)
			
			AND (CASE WHEN @Description is NULL THEN 1 WHEN Gen_EventCategory.Description  = @Description THEN 1 ELSE 0 END = 1)
