        @IPAddress varchar(100)= NULL,
        @TransID nvarchar(250) = NULL,
        @TS varchar(100)= NULL
    
	AS
	BEGIN
		DECLARE @UpperBand int, @LowerBand int
		
		
		
		SET @TotalRecord = 
			(
				SELECT 
					COUNT(*)
				FROM 
					gen_eventfileinfo
				WHERE 
(CASE WHEN @CommonSerachParam is NULL THEN 1 WHEN 					Gen_EventFileInfo.EventFileID  like @CommonSerachParam
