					 OR Gen_EventFileInfo.Ex_Nvarchar3  like @CommonSerachParam
					
					
					
					
					
					
					
					
					
					
					
 THEN 1 ELSE 0 END = 1)			)
		SET @LowerBand  = (@CurrentPage - 1) * @PageSize
		SET @UpperBand  = (@CurrentPage * @PageSize) + 1
		
		
		BEGIN
			WITH tempPagedgen_eventfileinfo AS
