						CASE WHEN @SortExpression ='CreatedByUserName ASC' THEN Gen_EventFileInfo.CreatedByUserName END ASC,
						CASE WHEN @SortExpression ='CreatedByUserName DESC' THEN Gen_EventFileInfo.CreatedByUserName END DESC,
						CASE WHEN @SortExpression ='CreatedDate ASC' THEN Gen_EventFileInfo.CreatedDate END ASC,
						CASE WHEN @SortExpression ='CreatedDate DESC' THEN Gen_EventFileInfo.CreatedDate END DESC,
