   CONVERT(bigint, Gen_EventInfo.TS) as TS  
   ,ROW_NUMBER() OVER  
    (  
     ORDER BY  
      CASE WHEN @SortExpression ='EventID ASC' THEN Gen_EventInfo.EventID END ASC,  
      CASE WHEN @SortExpression ='EventID DESC' THEN Gen_EventInfo.EventID END DESC,  
      CASE WHEN @SortExpression ='EventCategoryID ASC' THEN Gen_EventInfo.EventCategoryID END ASC,  
