                                       WHEN Gen_EventInfo.Ex_Nvarchar1 = @Ex_Nvarchar1
                                       THEN 1
                                       ELSE 0
                                   END = 1)
                               OR (CASE
                                       WHEN @Ex_Nvarchar2 IS NULL
                                       THEN 1
                                       WHEN Gen_EventInfo.Ex_Nvarchar2 = @Ex_Nvarchar2
                                       THEN 1
                                       ELSE 0
                                   END = 1)
                               OR (CASE
                                       WHEN @Ex_Nvarchar3 IS NULL
                                       THEN 1
                                       WHEN Gen_EventInfo.Ex_Nvarchar3 = @Ex_Nvarchar3
                                       THEN 1
                                       ELSE 0
                                   END = 1)
                               OR (CASE
                                       WHEN @Ex_Bigint1 IS NULL
                                       THEN 1
                                       WHEN Gen_EventInfo.Ex_Bigint1 = @Ex_Bigint1
                                       THEN 1
                                       ELSE 0
                                   END = 1)
                               OR (CASE
                                       WHEN @Ex_Bigint2 IS NULL
                                       THEN 1
                                       WHEN Gen_EventInfo.Ex_Bigint2 = @Ex_Bigint2
                                       THEN 1
                                       ELSE 0
                                   END = 1)
                               OR (CASE
                                       WHEN @Ex_Decimal1 IS NULL
                                       THEN 1
                                       WHEN Gen_EventInfo.Ex_Decimal1 = @Ex_Decimal1
                                       THEN 1
                                       ELSE 0
                                   END = 1)
                               OR (CASE
                                       WHEN @Ex_Decimal2 IS NULL
                                       THEN 1
                                       WHEN Gen_EventInfo.Ex_Decimal2 = @Ex_Decimal2
                                       THEN 1
                                       ELSE 0
                                   END = 1)
                               OR (CASE
                                       WHEN @userid IS NULL
                                       THEN 1
                                       WHEN Gen_EventInfo.EventOrganizedBy IN
            (
                SELECT UnitID
                FROM Gen_UserUnit
                WHERE UserId = @userid
            )
                                       THEN 1
                                       ELSE 0
                                   END = 1)
                           THEN 1
                           ELSE 0
                       END = 1)
        );
        SET @LowerBand = (@CurrentPage - 1) * @PageSize;
        SET @UpperBand = (@CurrentPage * @PageSize) + 1;
        BEGIN
            WITH tempPagedgen_eventinfo
                 AS (SELECT Gen_EventInfo.EventID, 
                            Gen_EventInfo.EventCategoryID, 
                            Gen_EventInfo.EventCode, 
                            Gen_EventInfo.EventName, 
                            Gen_EventInfo.EventStartDate, 
                            Gen_EventInfo.EventEndDate, 
                            Gen_EventInfo.EventDescription, 
                            Gen_EventInfo.EventDescription1, 
                            Gen_EventInfo.EventDescription2, 
                            Gen_EventInfo.EventSpecialNote, 
                            Gen_EventInfo.IsDeleted, 
                            Gen_EventInfo.EventOrganizedBy, 
                            Gen_EventInfo.Ex_Date1, 
                            Gen_EventInfo.Ex_Date2, 
                            Gen_EventInfo.Ex_Nvarchar1, 
                            Gen_EventInfo.Ex_Nvarchar2, 
                            Gen_EventInfo.Ex_Nvarchar3, 
                            Gen_EventInfo.Ex_Bigint1, 
                            Gen_EventInfo.Ex_Bigint2, 
                            Gen_EventInfo.Ex_Decimal1, 
                            Gen_EventInfo.Ex_Decimal2, 
                            Gen_EventInfo.TransID, 
                            Gen_EventInfo.CreatedByUserName, 
                            Gen_EventInfo.CreatedDate, 
                            Gen_EventInfo.UpdatedByUserName, 
                            Gen_EventInfo.UpdatedDate, 
                            Gen_EventInfo.IPAddress, 
                            CONVERT(BIGINT, TS) AS TS, 
                            ROW_NUMBER() OVER(
                            ORDER BY Gen_EventInfo.EventStartDate DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventID ASC'
                                         THEN Gen_EventInfo.EventID
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventID DESC'
                                         THEN Gen_EventInfo.EventID
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventCategoryID ASC'
                                         THEN Gen_EventInfo.EventCategoryID
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventCategoryID DESC'
                                         THEN Gen_EventInfo.EventCategoryID
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventCode ASC'
                                         THEN Gen_EventInfo.EventCode
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventCode DESC'
                                         THEN Gen_EventInfo.EventCode
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventName ASC'
                                         THEN Gen_EventInfo.EventName
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventName DESC'
                                         THEN Gen_EventInfo.EventName
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventStartDate ASC'
                                         THEN Gen_EventInfo.EventStartDate
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventStartDate DESC'
                                         THEN Gen_EventInfo.EventStartDate
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventEndDate ASC'
                                         THEN Gen_EventInfo.EventEndDate
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventEndDate DESC'
                                         THEN Gen_EventInfo.EventEndDate
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventDescription ASC'
                                         THEN Gen_EventInfo.EventDescription
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventDescription DESC'
                                         THEN Gen_EventInfo.EventDescription
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventDescription1 ASC'
                                         THEN Gen_EventInfo.EventDescription1
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventDescription1 DESC'
                                         THEN Gen_EventInfo.EventDescription1
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventDescription2 ASC'
                                         THEN Gen_EventInfo.EventDescription2
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventDescription2 DESC'
                                         THEN Gen_EventInfo.EventDescription2
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventSpecialNote ASC'
                                         THEN Gen_EventInfo.EventSpecialNote
                                     END ASC,
                                     CASE
