                                         THEN Gen_EventInfo.EventSpecialNote
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'IsDeleted ASC'
                                         THEN Gen_EventInfo.IsDeleted
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'IsDeleted DESC'
                                         THEN Gen_EventInfo.IsDeleted
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'EventOrganizedBy ASC'
                                         THEN Gen_EventInfo.EventOrganizedBy
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'EventOrganizedBy DESC'
                                         THEN Gen_EventInfo.EventOrganizedBy
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'TransID ASC'
                                         THEN Gen_EventInfo.TransID
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'TransID DESC'
                                         THEN Gen_EventInfo.TransID
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'CreatedByUserName ASC'
                                         THEN Gen_EventInfo.CreatedByUserName
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'CreatedByUserName DESC'
                                         THEN Gen_EventInfo.CreatedByUserName
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'CreatedDate ASC'
                                         THEN Gen_EventInfo.CreatedDate
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'CreatedDate DESC'
                                         THEN Gen_EventInfo.CreatedDate
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'UpdatedByUserName ASC'
                                         THEN Gen_EventInfo.UpdatedByUserName
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'UpdatedByUserName DESC'
                                         THEN Gen_EventInfo.UpdatedByUserName
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'UpdatedDate ASC'
                                         THEN Gen_EventInfo.UpdatedDate
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'UpdatedDate DESC'
                                         THEN Gen_EventInfo.UpdatedDate
                                     END DESC,
                                     CASE
                                         WHEN @SortExpression = 'IPAddress ASC'
                                         THEN Gen_EventInfo.IPAddress
                                     END ASC,
                                     CASE
                                         WHEN @SortExpression = 'IPAddress DESC'
                                         THEN Gen_EventInfo.IPAddress
                                     END DESC) AS RowNumber
                     FROM Gen_EventInfo
                     WHERE Gen_EventInfo.IsDeleted = 0
                           AND (CASE
                                    WHEN @CommonSerachParam IS NULL
                                    THEN 1
                                    WHEN(CASE
                                             WHEN @EventID IS NULL
                                             THEN 1
                                             WHEN Gen_EventInfo.EventID = @EventID
                                             THEN 1
                                             ELSE 0
                                         END = 1)
                                        OR (CASE
                                                WHEN @EventCategoryID IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventCategoryID = @EventCategoryID
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @EventCode IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventCode = @EventCode
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @EventName IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventName = @EventName
                                                THEN 1
                                                ELSE 0
