                                                THEN 1
                                                WHEN Gen_EventInfo.EventEndDate = @EventEndDate
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @EventDescription IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventDescription = @EventDescription
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @EventDescription1 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventDescription1 = @EventDescription1
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @EventDescription2 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventDescription2 = @EventDescription2
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @EventSpecialNote IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventSpecialNote = @EventSpecialNote
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @EventOrganizedBy IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventOrganizedBy = @EventOrganizedBy
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Date1 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Date1 = @Ex_Date1
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Date2 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Date2 = @Ex_Date2
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Nvarchar1 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Nvarchar1 = @Ex_Nvarchar1
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Nvarchar2 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Nvarchar2 = @Ex_Nvarchar2
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Nvarchar3 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Nvarchar3 = @Ex_Nvarchar3
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Bigint1 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Bigint1 = @Ex_Bigint1
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Bigint2 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Bigint2 = @Ex_Bigint2
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Decimal1 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Decimal1 = @Ex_Decimal1
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @Ex_Decimal2 IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.Ex_Decimal2 = @Ex_Decimal2
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                        OR (CASE
                                                WHEN @userid IS NULL
                                                THEN 1
                                                WHEN Gen_EventInfo.EventOrganizedBy IN
                     (
                         SELECT UnitID
                         FROM Gen_UserUnit
                         WHERE UserId = @userid
                     )
                                                THEN 1
                                                ELSE 0
                                            END = 1)
                                    THEN 1
                                    ELSE 0
                                END = 1))
                 SELECT *
                 FROM tempPagedgen_eventinfo
                 WHERE RowNumber > @LowerBand
                       AND RowNumber < @UpperBand;
        END;
    END;
