CREATE PROCEDURE [dbo].[gen_unit_GAPgDropDown] 
		@UnitID bigint  = NULL,
		@Unit nvarchar (500) = NULL,
		@UnitCode nvarchar (50) = NULL,
		@Ex_Date1 datetime  = NULL,
		@Ex_Date2 datetime  = NULL,
		@Ex_Nvarchar1 nvarchar (250) = NULL,
		@Ex_Nvarchar2 nvarchar (250) = NULL,
		@Ex_Nvarchar3 nvarchar (250) = NULL,
		@Ex_Bigint1 bigint  = NULL,
		@Ex_Bigint2 bigint  = NULL,
		@Ex_Decimal1 decimal (18, 2) = NULL,
		@Ex_Decimal2 decimal (18, 2) = NULL,
		    
        @CommonSerachParam nvarchar(256)= NULL,

        @TotalRecord bigint = null output,
        @SortExpression VARCHAR(MAX)  = NULL,
        @PageSize BIGINT = NULL,
        @CurrentPage BIGINT  = NULL,
        @CreatedByUserName nvarchar(256)= NULL,
        @UpdatedByUserName nvarchar(256)= NULL,
        @CreatedDate DATETIME= NULL,
        @UpdatedDate DATETIME= NULL,
        @IPAddress varchar(100)= NULL,
        @TransID nvarchar(250) = NULL,
        @TS varchar(100)= NULL
    
	AS
	BEGIN
		DECLARE @UpperBand int, @LowerBand int
		
		
		
		SET @TotalRecord = 
			(
				SELECT 
					COUNT(*)
				FROM 
					gen_unit
				WHERE 
					(CASE WHEN @UnitID is NULL THEN 1 WHEN Gen_Unit.UnitID  = @UnitID THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Unit is NULL THEN 1 WHEN Gen_Unit.Unit  = @Unit THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @UnitCode is NULL THEN 1 WHEN Gen_Unit.UnitCode  = @UnitCode THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Date1 is NULL THEN 1 WHEN Gen_Unit.Ex_Date1  = @Ex_Date1 THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Date2 is NULL THEN 1 WHEN Gen_Unit.Ex_Date2  = @Ex_Date2 THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Nvarchar1 is NULL THEN 1 WHEN Gen_Unit.Ex_Nvarchar1  = @Ex_Nvarchar1 THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Nvarchar2 is NULL THEN 1 WHEN Gen_Unit.Ex_Nvarchar2  = @Ex_Nvarchar2 THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Nvarchar3 is NULL THEN 1 WHEN Gen_Unit.Ex_Nvarchar3  = @Ex_Nvarchar3 THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Bigint1 is NULL THEN 1 WHEN Gen_Unit.Ex_Bigint1  = @Ex_Bigint1 THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Bigint2 is NULL THEN 1 WHEN Gen_Unit.Ex_Bigint2  = @Ex_Bigint2 THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Decimal1 is NULL THEN 1 WHEN Gen_Unit.Ex_Decimal1  = @Ex_Decimal1 THEN 1 ELSE 0 END = 1)
					AND (CASE WHEN @Ex_Decimal2 is NULL THEN 1 WHEN Gen_Unit.Ex_Decimal2  = @Ex_Decimal2 THEN 1 ELSE 0 END = 1)
					
					
					
					
					
					
					
                        
                       AND (CASE WHEN @CommonSerachParam is NULL THEN 1 WHEN 					Gen_Unit.UnitID  like @CommonSerachParam
					 OR Gen_Unit.Unit  like @CommonSerachParam
					 OR Gen_Unit.UnitCode  like @CommonSerachParam
					
					
					
					
					 OR Gen_Unit.Ex_Nvarchar3  like @CommonSerachParam
					
					
					
					
					
					
					
					
					
					
					
 THEN 1 ELSE 0 END = 1)
			)
		SET @LowerBand  = (@CurrentPage - 1) * @PageSize
		SET @UpperBand  = (@CurrentPage * @PageSize) + 1
		
		
		BEGIN
			WITH tempPagedgen_unit AS
			(
				  SELECT 
			Gen_Unit.UnitID as Id, 
			Gen_Unit.Unit as Text
			,ROW_NUMBER() OVER
				(
					ORDER BY
						CASE WHEN @SortExpression ='UnitID ASC' THEN Gen_Unit.UnitID END ASC,
						CASE WHEN @SortExpression ='UnitID DESC' THEN Gen_Unit.UnitID END DESC,
						CASE WHEN @SortExpression ='UnitCode ASC' THEN Gen_Unit.UnitCode END ASC,
						CASE WHEN @SortExpression ='UnitCode DESC' THEN Gen_Unit.UnitCode END DESC,
						CASE WHEN @SortExpression ='Ex_Date1 ASC' THEN Gen_Unit.Ex_Date1 END ASC,
						CASE WHEN @SortExpression ='Ex_Date1 DESC' THEN Gen_Unit.Ex_Date1 END DESC,
						CASE WHEN @SortExpression ='Ex_Date2 ASC' THEN Gen_Unit.Ex_Date2 END ASC,
						CASE WHEN @SortExpression ='Ex_Date2 DESC' THEN Gen_Unit.Ex_Date2 END DESC,
						CASE WHEN @SortExpression ='Ex_Nvarchar1 ASC' THEN Gen_Unit.Ex_Nvarchar1 END ASC,
						CASE WHEN @SortExpression ='Ex_Nvarchar1 DESC' THEN Gen_Unit.Ex_Nvarchar1 END DESC,
						CASE WHEN @SortExpression ='Ex_Nvarchar2 ASC' THEN Gen_Unit.Ex_Nvarchar2 END ASC,
						CASE WHEN @SortExpression ='Ex_Nvarchar2 DESC' THEN Gen_Unit.Ex_Nvarchar2 END DESC,
						CASE WHEN @SortExpression ='Ex_Nvarchar3 ASC' THEN Gen_Unit.Ex_Nvarchar3 END ASC,
						CASE WHEN @SortExpression ='Ex_Nvarchar3 DESC' THEN Gen_Unit.Ex_Nvarchar3 END DESC,
						CASE WHEN @SortExpression ='Ex_Bigint1 ASC' THEN Gen_Unit.Ex_Bigint1 END ASC,
						CASE WHEN @SortExpression ='Ex_Bigint1 DESC' THEN Gen_Unit.Ex_Bigint1 END DESC,
						CASE WHEN @SortExpression ='Ex_Bigint2 ASC' THEN Gen_Unit.Ex_Bigint2 END ASC,
						CASE WHEN @SortExpression ='Ex_Bigint2 DESC' THEN Gen_Unit.Ex_Bigint2 END DESC,
						CASE WHEN @SortExpression ='Ex_Decimal1 ASC' THEN Gen_Unit.Ex_Decimal1 END ASC,
						CASE WHEN @SortExpression ='Ex_Decimal1 DESC' THEN Gen_Unit.Ex_Decimal1 END DESC,
						CASE WHEN @SortExpression ='Ex_Decimal2 ASC' THEN Gen_Unit.Ex_Decimal2 END ASC,
						CASE WHEN @SortExpression ='Ex_Decimal2 DESC' THEN Gen_Unit.Ex_Decimal2 END DESC,
						CASE WHEN @SortExpression ='TransID ASC' THEN Gen_Unit.TransID END ASC,
						CASE WHEN @SortExpression ='TransID DESC' THEN Gen_Unit.TransID END DESC,
						CASE WHEN @SortExpression ='CreatedByUserName ASC' THEN Gen_Unit.CreatedByUserName END ASC,
						CASE WHEN @SortExpression ='CreatedByUserName DESC' THEN Gen_Unit.CreatedByUserName END DESC,
						CASE WHEN @SortExpression ='CreatedDate ASC' THEN Gen_Unit.CreatedDate END ASC,
						CASE WHEN @SortExpression ='CreatedDate DESC' THEN Gen_Unit.CreatedDate END DESC,
						CASE WHEN @SortExpression ='UpdatedByUserName ASC' THEN Gen_Unit.UpdatedByUserName END ASC,
						CASE WHEN @SortExpression ='UpdatedByUserName DESC' THEN Gen_Unit.UpdatedByUserName END DESC,
						CASE WHEN @SortExpression ='UpdatedDate ASC' THEN Gen_Unit.UpdatedDate END ASC,
						CASE WHEN @SortExpression ='UpdatedDate DESC' THEN Gen_Unit.UpdatedDate END DESC,
						CASE WHEN @SortExpression ='IPAddress ASC' THEN Gen_Unit.IPAddress END ASC,
						CASE WHEN @SortExpression ='IPAddress DESC' THEN Gen_Unit.IPAddress END DESC
				) as RowNumber
		FROM Gen_Unit 
		where
			(CASE WHEN @UnitID is NULL THEN 1 WHEN Gen_Unit.UnitID  = @UnitID THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Unit is NULL THEN 1 WHEN Gen_Unit.Unit  = @Unit THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @UnitCode is NULL THEN 1 WHEN Gen_Unit.UnitCode  = @UnitCode THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Date1 is NULL THEN 1 WHEN Gen_Unit.Ex_Date1  = @Ex_Date1 THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Date2 is NULL THEN 1 WHEN Gen_Unit.Ex_Date2  = @Ex_Date2 THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Nvarchar1 is NULL THEN 1 WHEN Gen_Unit.Ex_Nvarchar1  = @Ex_Nvarchar1 THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Nvarchar2 is NULL THEN 1 WHEN Gen_Unit.Ex_Nvarchar2  = @Ex_Nvarchar2 THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Nvarchar3 is NULL THEN 1 WHEN Gen_Unit.Ex_Nvarchar3  = @Ex_Nvarchar3 THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Bigint1 is NULL THEN 1 WHEN Gen_Unit.Ex_Bigint1  = @Ex_Bigint1 THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Bigint2 is NULL THEN 1 WHEN Gen_Unit.Ex_Bigint2  = @Ex_Bigint2 THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Decimal1 is NULL THEN 1 WHEN Gen_Unit.Ex_Decimal1  = @Ex_Decimal1 THEN 1 ELSE 0 END = 1)
			AND (CASE WHEN @Ex_Decimal2 is NULL THEN 1 WHEN Gen_Unit.Ex_Decimal2  = @Ex_Decimal2 THEN 1 ELSE 0 END = 1)
			
			
			
			
			
			
			
            AND (CASE WHEN @CommonSerachParam is NULL THEN 1 WHEN 					Gen_Unit.UnitID  like @CommonSerachParam
					 OR Gen_Unit.Unit  like @CommonSerachParam
					 OR Gen_Unit.UnitCode  like @CommonSerachParam
					
					
					
					
					 OR Gen_Unit.Ex_Nvarchar3  like @CommonSerachParam
					
					
					
					
					
					
					
					
					
					
					
 THEN 1 ELSE 0 END = 1)
			)
			SELECT * 
			FROM  tempPagedgen_unit
			WHERE RowNumber > @LowerBand AND RowNumber < @UpperBand
			end

	END  
GO
