CREATE PROCEDURE [dbo].[gen_unit_GAPgDropDown_By_UserId] @UnitID            BIGINT           = NULL,   
                                                @Unit              NVARCHAR(500)    = NULL,   
                                                @UnitCode          NVARCHAR(50)     = NULL,   
                                                @Ex_Date1          DATETIME         = NULL,   
                                                @Ex_Date2          DATETIME         = NULL,   
                                                @Ex_Nvarchar1      NVARCHAR(250)    = NULL,   
                                                @Ex_Nvarchar2      NVARCHAR(250)    = NULL,   
                                                @Ex_Nvarchar3      NVARCHAR(250)    = NULL,   
                                                @Ex_Bigint1        BIGINT           = NULL,   
                                                @Ex_Bigint2        BIGINT           = NULL,   
                                                @Ex_Decimal1       DECIMAL(18, 2)    = NULL,   
                                                @Ex_Decimal2       DECIMAL(18, 2)    = NULL,   
                                                @CommonSerachParam NVARCHAR(256)    = NULL,   
                                                @TotalRecord       BIGINT           = NULL OUTPUT,   
                                                @SortExpression    VARCHAR(MAX)     = NULL,   
                                                @PageSize          BIGINT           = NULL,   
                                                @CurrentPage       BIGINT           = NULL,   
                                                @UserId            UNIQUEIDENTIFIER = NULL,   
                                                @CreatedByUserName NVARCHAR(256)    = NULL,   
                                                @UpdatedByUserName NVARCHAR(256)    = NULL,   
                                                @CreatedDate       DATETIME         = NULL,   
                                                @UpdatedDate       DATETIME         = NULL,   
                                                @IPAddress         VARCHAR(100)     = NULL,   
                                                @TransID           NVARCHAR(250)    = NULL,   
                                                @TS                VARCHAR(100)     = NULL  
AS  
    BEGIN  
        DECLARE @UserMapped BIGINT= 0;  
        SET @UserMapped =  
        (  
            SELECT COUNT(*)  
            FROM Gen_UserUnit  
            WHERE UserId = @UserId  
        );  
        PRINT @UserMapped;  
        DECLARE @UpperBand INT, @LowerBand INT;  
        SET @TotalRecord =  
        (  
            SELECT COUNT(*)  
            FROM gen_unit  
            WHERE(CASE  
                      WHEN @CommonSerachParam IS NULL  
                      THEN 1  
                      WHEN Gen_Unit.Unit LIKE @CommonSerachParam  
                      THEN 1  
                      ELSE 0  
                  END = 1)  
                 AND (CASE  
                          WHEN @UserMapped > 0  
                               AND gen_unit.UnitID IN  
            (  
                SELECT UnitID  
                FROM Gen_UserUnit  
                WHERE UserId = @UserId  
            )  
                          THEN 1  
                          WHEN @UserMapped = 0 THEN 1  
                      END = 1)  
        );  
        SET @LowerBand = (@CurrentPage - 1) * @PageSize;  
        SET @UpperBand = (@CurrentPage * @PageSize) + 1;  
        BEGIN  
            WITH tempPagedgen_unit  
                 AS (SELECT Gen_Unit.UnitID AS Id,   
                            Gen_Unit.UnitCode + ' - ' + Gen_Unit.Unit AS Text,   
                            ROW_NUMBER() OVER(  
                            ORDER BY CASE  
                                         WHEN @SortExpression = 'UnitID ASC'  
                                         THEN Gen_Unit.UnitID  
                                     END ASC,  
                             CASE  
                                         WHEN @SortExpression = 'UnitID DESC'  
                                         THEN Gen_Unit.UnitID  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'UnitCode ASC'  
                                         THEN Gen_Unit.UnitCode  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'UnitCode DESC'  
                                         THEN Gen_Unit.UnitCode  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Date1 ASC'  
                                         THEN Gen_Unit.Ex_Date1  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Date1 DESC'  
                                         THEN Gen_Unit.Ex_Date1  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Date2 ASC'  
                                         THEN Gen_Unit.Ex_Date2  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Date2 DESC'  
                                         THEN Gen_Unit.Ex_Date2  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Nvarchar1 ASC'  
                                         THEN Gen_Unit.Ex_Nvarchar1  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Nvarchar1 DESC'  
                                         THEN Gen_Unit.Ex_Nvarchar1  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Nvarchar2 ASC'  
                                         THEN Gen_Unit.Ex_Nvarchar2  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Nvarchar2 DESC'  
                                         THEN Gen_Unit.Ex_Nvarchar2  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Nvarchar3 ASC'  
                                         THEN Gen_Unit.Ex_Nvarchar3  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Nvarchar3 DESC'  
                                         THEN Gen_Unit.Ex_Nvarchar3  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Bigint1 ASC'  
                                         THEN Gen_Unit.Ex_Bigint1  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Bigint1 DESC'  
                                         THEN Gen_Unit.Ex_Bigint1  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Bigint2 ASC'  
                                         THEN Gen_Unit.Ex_Bigint2  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Bigint2 DESC'  
                                         THEN Gen_Unit.Ex_Bigint2  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Decimal1 ASC'  
                                         THEN Gen_Unit.Ex_Decimal1  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Decimal1 DESC'  
                                         THEN Gen_Unit.Ex_Decimal1  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Decimal2 ASC'  
                                         THEN Gen_Unit.Ex_Decimal2  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'Ex_Decimal2 DESC'  
                                         THEN Gen_Unit.Ex_Decimal2  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'TransID ASC'  
                                         THEN Gen_Unit.TransID  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'TransID DESC'  
                                         THEN Gen_Unit.TransID  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'CreatedByUserName ASC'  
                                         THEN Gen_Unit.CreatedByUserName  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'CreatedByUserName DESC'  
                                         THEN Gen_Unit.CreatedByUserName  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'CreatedDate ASC'  
                                         THEN Gen_Unit.CreatedDate  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'CreatedDate DESC'  
                                         THEN Gen_Unit.CreatedDate  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'UpdatedByUserName ASC'  
                                         THEN Gen_Unit.UpdatedByUserName  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'UpdatedByUserName DESC'  
                                         THEN Gen_Unit.UpdatedByUserName  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'UpdatedDate ASC'  
                                         THEN Gen_Unit.UpdatedDate  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'UpdatedDate DESC'  
                                         THEN Gen_Unit.UpdatedDate  
                                     END DESC,  
                                     CASE  
                                         WHEN @SortExpression = 'IPAddress ASC'  
                                         THEN Gen_Unit.IPAddress  
                                     END ASC,  
                                     CASE  
                                         WHEN @SortExpression = 'IPAddress DESC'  
                                         THEN Gen_Unit.IPAddress  
                                     END DESC) AS RowNumber  
                     FROM Gen_Unit  
                     WHERE(CASE  
                               WHEN @CommonSerachParam IS NULL  
                               THEN 1  
                               WHEN Gen_Unit.Unit LIKE @CommonSerachParam  
                               THEN 1  
                               ELSE 0  
                           END = 1)  
                          AND (CASE  
                                   WHEN @UserMapped > 0 AND gen_unit.UnitID IN  
            (  
             SELECT UnitID  
             FROM Gen_UserUnit  
             WHERE UserId = @UserId  
            )  
                                   THEN 1  
                                   WHEN @UserMapped = 0 THEN 1  
                               END = 1))  
                 SELECT *  
                 FROM tempPagedgen_unit  
                 WHERE RowNumber > @LowerBand  
                       AND RowNumber < @UpperBand;  
        END;  
    END;
GO
