			 OR (CASE WHEN @Ex_Decimal1 is NULL THEN 1 WHEN Gen_Unit.Ex_Decimal1  = @Ex_Decimal1 THEN 1 ELSE 0 END = 1)
			 OR (CASE WHEN @Ex_Decimal2 is NULL THEN 1 WHEN Gen_Unit.Ex_Decimal2  = @Ex_Decimal2 THEN 1 ELSE 0 END = 1)
			
			
			
			
			
			
			
 THEN 1 ELSE 0 END = 1)			)
			SELECT * 
