exec GetStatusByCivilID @CivilID=N'304082700416' 2 -d      
exec GetStatusByCivilID @CivilID=N'304082200446' 3 -d      
exec GetStatusByCivilID @CivilID=N'304022600974' 4 -d      
exec GetStatusByCivilID @CivilID=N'304012700541' 5 -d      
exec GetStatusByCivilID @CivilID=N'303062700924' 6 -d      
exec GetStatusByCivilID @CivilID=N'304091300684' 7 -d      
