CREATE PROCEDURE [dbo].[GetStatusByCivilID] @CivilID NVARCHAR(50) = NULL  
AS  
  
    --if (@CivilID = '304032500117')      
    --begin      
    -- --set @CivilID = '301060600496'      
    -- set @CivilID = '304090400843'      
    --end      
    ----if (@CivilID = '278040701182')      
    ----begin      
    ---- --set @CivilID = '301060600496'      
    ---- set @CivilID = '304090400843'      
    ----end      
    --      
    BEGIN  
        SELECT DISTINCT   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.civilid,   
               [KNS_6.0].dbo.Kns_Tran_RegEducationInfo.basicinfoid,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.name1,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.name2,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.name3,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.name4,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.name5,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.FullName,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.nationalid,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.dob,   
               [KNS_6.0].dbo.Fn_agecalculate([KNS_6.0].dbo.Kns_Tran_RegistrationProfile.dob, [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.createddate) AS Age,      
        --[KNS_6.0].dbo.Kns_Tran_RegistrationProfile.preaddress,                 
               isnull(convert(varchar ,[KNS_6.0].dbo.Kns_Tran_RegistrationProfile.PerPaci), '0') as prepaci  ,
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.mob1,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.telephone1,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.telephone3,   
               [KNS_6.0].dbo.gen_maritalstatus.maritalstatus,   
               ISNULL([KNS_6.0].dbo.Kns_Gen_Certificatesubjects.certificateid, [KNS_6.0].dbo.Kns_Tran_RegEducationInfo.certificateid) AS CertificateID,   
               [KNS_6.0].dbo.Kns_Gen_Certificate.certificatename,   
               ISNULL([KNS_6.0].dbo.Kns_Gen_Certificatesubjects.certificatesubjectid, [KNS_6.0].dbo.Kns_Tran_RegEducationInfo.certificatesubjectid) AS CertificateSubjectID,   
               [KNS_6.0].dbo.Kns_Gen_Certificatesubjects.certificatesubjectname,   
               [KNS_6.0].dbo.Gen_GovCity.cityname AS GvName,   
               Gen_Country_1.cityname,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddstreet as preaddstreet,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddblock as preaddblock,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddhousingno as preaddhousingno,   
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddhousingflatno as preaddhousingflatno,  
               CASE  
                   WHEN [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddhousingflatno IS NULL  
                   THEN ''  
                   ELSE N'الدور: ' + [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddhousingflatno + ', '  
               END + CASE  
                         WHEN [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddhousingno IS NULL  
                         THEN ''  
                         ELSE N'المنزل: ' + [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddhousingno + ', '  
                     END + CASE  
                               WHEN [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddblock IS NULL  
                               THEN ''  
                               ELSE N'القطعه: ' + [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddblock + ', '  
                           END + CASE  
                                     WHEN [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddstreet IS NULL  
                                     THEN ''  
                                     ELSE N'الشارع: ' + [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.peraddstreet + ', '  
                                 END + CASE  
                                           WHEN Gen_Country_1.cityname IS NULL  
                                           THEN ''  
                                           ELSE N'المنطقه : ' + Gen_Country_1.cityname + ', '  
                                       END + CASE  
                                                 WHEN [KNS_6.0].dbo.Gen_GovCity.cityname IS NULL  
                                                 THEN ''  
                                                 ELSE N'المحافظه : ' + [KNS_6.0].dbo.Gen_GovCity.cityname + ''  
                                             END AS preaddress,      
        --convert(bigint, 8) as CaseStatusID,       
               CASE  
                   WHEN [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.TrainingStatus IS NULL  
                   THEN convert(bigint, '-99')  
                   ELSE convert(bigint, [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.TrainingStatus)  
               END AS CaseStatusID,   
               --[KNS_6.0].dbo.Kns_Tran_RegistrationProfile.CaseNo,   
      Kns_Batch.BatchNo CaseNo,  
               --[KNS_6.0].dbo.Kns_Tran_RegistrationProfile.CaseExpiryDate,    
      (case when isnull(Kns_Tran_RegistrationProfile.TrainingStatus,1)=1 then null else Kns_StatusChangeRequestResolution.DelayEndDate end) CaseExpiryDate, 
	  (case when isnull(Kns_Tran_RegistrationProfile.TrainingStatus,1)=1 then null else (CASE  
                   WHEN [KNS_6.0].dbo.Kns_Gen_DecisionType.DecisionType IS NULL  
                   THEN N'حالة المكلف قيد التدقيق من قبل هيئة الخدمة الوطنية العسكرية'  
                   ELSE [KNS_6.0].dbo.Kns_Gen_DecisionType.DecisionType + CASE  
                                                                                 WHEN CONVERT(DATE, [KNS_6.0].dbo.Kns_StatusChangeRequestResolution.DelayEndDate, 103) IS NULL  
                                                                                 THEN ''  
                                                                                 ELSE+CHAR(10) + N' لغاية : ' + (CAST(ISNULL(CONVERT(DATE, [KNS_6.0].dbo.Kns_StatusChangeRequestResolution.DelayEndDate, 103), '') AS NVARCHAR))  
                                                                             END  
               END) end)
                AS CaseStatus,   
      --null CaseStatus,  
               [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.CreatedDate  
        FROM [KNS_6.0].dbo.Gen_GovCity AS Gen_Country_1  
             RIGHT OUTER JOIN [KNS_6.0].dbo.Kns_Tran_RegistrationProfile ON Gen_Country_1.cityid = [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.PerAddCityID  
             LEFT OUTER JOIN [KNS_6.0].dbo.Gen_GovCity ON [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.PerAddGovernID = [KNS_6.0].dbo.Gen_GovCity.cityid  
             LEFT OUTER JOIN [KNS_6.0].dbo.Kns_Tran_RegEducationInfo ON [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.basicinfoid = [KNS_6.0].dbo.Kns_Tran_RegEducationInfo.basicinfoid  
             LEFT OUTER JOIN [KNS_6.0].dbo.gen_maritalstatus ON [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.maritalstatus = [KNS_6.0].dbo.gen_maritalstatus.maritalstatusid  
             LEFT OUTER JOIN [KNS_6.0].dbo.Kns_Gen_Certificate ON [KNS_6.0].dbo.Kns_Tran_RegEducationInfo.certificateid = [KNS_6.0].dbo.Kns_Gen_Certificate.certificateid  
             LEFT OUTER JOIN [KNS_6.0].dbo.Kns_Gen_Certificatesubjects ON [KNS_6.0].dbo.Kns_Tran_RegEducationInfo.certificatesubjectid = [KNS_6.0].dbo.Kns_Gen_Certificatesubjects.certificatesubjectid  
             LEFT OUTER JOIN [KNS_6.0].dbo.Kns_Gen_DecisionType ON [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.TrainingStatus = [KNS_6.0].dbo.Kns_Gen_DecisionType.DecisionTypeId  
			 LEFT OUTER JOIN [KNS_6.0].dbo.Kns_BatchDetail ON [KNS_6.0].dbo.Kns_BatchDetail.PlanOrderDetailId = [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.CurrentPlanOrderDetailId 
			 left join (select BasicInfoID,max(DelayRequestResolutionId) MaxDelayRequestResolutionId from [KNS_6.0].dbo.Kns_StatusChangeRequestResolution group by BasicInfoID) as tKns_StatusChangeRequestResolution on tKns_StatusChangeRequestResolution.BasicInfoID=Kns_Tran_RegistrationProfile.BasicInfoID
			 left join [KNS_6.0].dbo.Kns_StatusChangeRequestResolution on tKns_StatusChangeRequestResolution.MaxDelayRequestResolutionId=Kns_StatusChangeRequestResolution.DelayRequestResolutionId
			 LEFT OUTER JOIN [KNS_6.0].dbo.Kns_Batch ON [KNS_6.0].dbo.Kns_Batch.BatchId = [KNS_6.0].dbo.Kns_BatchDetail.BatchId  
        WHERE [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.CivilID = @CivilID  
              AND ISNULL([KNS_6.0].dbo.Kns_Tran_RegEducationInfo.certificateid, 0) = ISNULL(  
        (  
            SELECT TOP 1 p.CertificateID  
            FROM [KNS_6.0].dbo.Kns_Gen_Certificatesubjects p  
                 INNER JOIN [KNS_6.0].dbo.Kns_Tran_RegEducationInfo q ON p.CertificateID = q.CertificateID  
            WHERE q.BasicInfoID = Kns_Tran_RegistrationProfile.BasicInfoID  
            ORDER BY p.CertificateID DESC  
        ), 0)  
                  AND ISNULL([KNS_6.0].dbo.Kns_Tran_RegEducationInfo.CertificateSubjectID, 0) = ISNULL(  
        (  
            SELECT TOP 1 ISNULL(q.CertificateSubjectID, 0)  
            FROM [KNS_6.0].dbo.Kns_Gen_Certificatesubjects p  
                 INNER JOIN [KNS_6.0].dbo.Kns_Tran_RegEducationInfo q ON p.CertificateID = q.CertificateID  
            WHERE q.BasicInfoID = [KNS_6.0].dbo.Kns_Tran_RegistrationProfile.BasicInfoID  
            ORDER BY ISNULL(q.CertificateSubjectID, 0) DESC  
        ), 0);  
    END;
GO
/****** Object:  StoredProcedure [dbo].[KAF_GetMenuWiseFormActionList]    Script Date: 12/16/2024 6:29:43 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
--KAF_GetMenuWiseFormActionList @UserId='29640e6f-d66f-4d89-a249-013f05d9c9d6'        
--KAF_GetMenuWiseFormActionList @UserId='29640e6f-d66f-4d89-a249-013f05d9c9d6',@MasterUserID=122    @isView, @actionname                
CREATE PROCEDURE [dbo].[KAF_GetMenuWiseFormActionList] @MasterUserID        BIGINT           = NULL,       
                                                      @UserId              UNIQUEIDENTIFIER = NULL,       
                                                      @Ex_Date1            DATETIME         = NULL,       
                                                      @Ex_Date2            DATETIME         = NULL,       
                                                      @Ex_Nvarchar1        NVARCHAR(250)    = NULL,       
                                                      @Ex_Nvarchar2        NVARCHAR(250)    = NULL,       
                                                      @Ex_Bigint1          BIGINT           = NULL,       
                                                      @Ex_Bigint2          BIGINT           = NULL,       
                                                      @Ex_Decimal1         DECIMAL(18, 2)    = NULL,       
                                                      @Ex_Decimal2         DECIMAL(18, 2)    = NULL,       
                                                      @SortExpression      VARCHAR(MAX)     = NULL,       
                                                      @CreatedBy           BIGINT           = NULL,       
                                                      @CreatedByUserName   NVARCHAR(256)    = NULL,       
                                                      @UpdatedBy           BIGINT           = NULL,       
                                                      @UpdatedByUserName   NVARCHAR(256)    = NULL,       
                                                      @CreatedDate         DATETIME         = NULL,       
                                                      @UpdatedDate         DATETIME         = NULL,       
                                                      @FormID              BIGINT           = NULL,       
                                                      @IPAddress           VARCHAR(100)     = NULL,       
                                                      @TransID             NVARCHAR(250)    = NULL,       
                                                      @UserOrganizationKey BIGINT           = NULL,       
                                                      @UserEntityKey       BIGINT           = NULL,       
                                                      @Ts                  BIGINT           = NULL,       
                                                      @IsVisibleInMenu     BIT              = NULL      
AS      
    BEGIN      
        DECLARE @vMenu TABLE      
        (AppFormID        BIGINT NULL,       
         FormName         NVARCHAR(350) NULL,       
         FormNameAr       NVARCHAR(350) NULL,       
         ParentID         BIGINT NULL,       
         URL              NVARCHAR(350) NULL,       
         Sequence         INT NULL,       
         FormActionID     BIGINT NULL,       
         ActionName       NVARCHAR(350) NULL,       
         EventName        NVARCHAR(350) NULL,       
         DisplayName      NVARCHAR(350) NULL,       
         DisplayNameAr    NVARCHAR(350) NULL,       
         ActionType       NVARCHAR(350) NULL,       
         IsAPI            BIT NULL,       
         IsView           BIT NULL,       
         IsVisibleInMenu  BIT NULL, --Added on 22-Mar-2021/Nur            
         RolePremissionID BIGINT NULL,       
         STATUS           BIT NULL,       
         Ex_Nvarchar1     NVARCHAR(250) NULL,       
         MenuType         BIGINT NULL, ----1 for Menu/Form, 2- Action           
         ClassIcon        VARCHAR(150) NULL      
        );      
      
        --------------------------------------------                    
      
        DECLARE @vMenuDetl TABLE      
        (AppFormID        BIGINT NULL,       
         FormName         NVARCHAR(350) NULL,       
         FormNameAr       NVARCHAR(350) NULL,       
         ParentID         BIGINT NULL,       
         URL              NVARCHAR(350) NULL,       
         Sequence        INT NULL,       
         FormActionID     BIGINT NULL,       
         ActionName       NVARCHAR(350) NULL,       
         EventName        NVARCHAR(350) NULL,       
         DisplayName      NVARCHAR(350) NULL,       
         DisplayNameAr    NVARCHAR(350) NULL,       
         ActionType       NVARCHAR(350) NULL,       
         IsAPI            BIT NULL,       
         IsView           BIT NULL,       
         IsVisibleInMenu  BIT NULL, --Added on 22-Mar-2021/Nur            
         RolePremissionID BIGINT NULL,       
         STATUS           BIT NULL,       
         Ex_Nvarchar1     NVARCHAR(250) NULL,       
         MenuType         BIGINT NULL, ----1 for Menu/Form, 2- Action                    
         Path             NVARCHAR(500),       
         ClassIcon        VARCHAR(150) NULL      
        );      
      
        -----------------------------------------------                    
        DECLARE @vMenuParentPath TABLE(path NVARCHAR(500));      
      
        -----------------------------------------------------------                    
        DECLARE @vAppForm TABLE(AppFormID BIGINT NULL);      
        DECLARE @vAppFormAll TABLE(AppFormID BIGINT NULL);      
        DECLARE @vAppFormParent TABLE(ParentID BIGINT NULL);      
      
        --------------------------------------------------------                    
        INSERT INTO @vAppForm      
               SELECT DISTINCT       
                      Owin_RolePermission.AppFormID      
               FROM Owin_RolePermission      
                    INNER JOIN Owin_UserRole ON Owin_RolePermission.RoleID = Owin_UserRole.RoleID      
                    INNER JOIN Owin_FormAction ON Owin_FormAction.FormActionID = Owin_RolePermission.FormActionID      
               WHERE(CASE      
                         WHEN @UserId IS NULL      
                         THEN 1      
                         WHEN UserId = @UserId      
                         THEN 1      
                         ELSE 0      
                     END = 1)      
                    AND (CASE      
                             WHEN @MasterUserID IS NULL      
                             THEN 1      
                             WHEN MasterUserID = @MasterUserID      
                             THEN 1      
                             ELSE 0      
                         END = 1)      
                    AND ISNULL(STATUS, 0) != 0  
     AND ISNULL(Owin_FormAction.IsView,0)=1;      
        PRINT 'test';                    
        --AND isnull(Owin_FormAction.IsView, 0) = 1;                      
        --  Select * from  @vAppForm  --Where AppFormID=40473                    
      
        WITH menu_cte      
             AS (SELECT AppFormID,       
                        ParentID      
                 FROM Owin_FormInfo      
                 WHERE ISNULL(AppFormID, 0) IN      
                 (      
                     SELECT AppFormID      
                     FROM @vAppForm      
                 )      
                 UNION ALL      
                 SELECT Owin_FormInfo.appformid,       
                        Owin_FormInfo.parentid      
                 FROM Owin_FormInfo      
                      INNER JOIN menu_cte ON menu_cte.ParentID = Owin_FormInfo.AppFormID                    
                 --WHERE vAction1.ParentID > 0                    
                 -- -- And   vAction1.AppFormID  in ( Select   ParentID from @vAppFormParent)                    
                 )      
             INSERT INTO @vAppFormAll      
                    SELECT DISTINCT       
                           appformid      
                    FROM menu_cte;      
      
        --Select * from @vAppFormAll                  
        --order by AppFormID            
        -----------------------------------------                    
        INSERT INTO @vMenu      
               SELECT [dbo].[Owin_FormInfo].AppFormID,       
                      [dbo].[Owin_FormInfo].FormName,       
                      [dbo].[Owin_FormInfo].FormNameAr,       
                      ISNULL([dbo].[Owin_FormInfo].parentid, 0) ParentID,                      
                      --CAST(0 AS BIGINT) AS AppFormID,                      
                      --CAST('' AS NVARCHAR(100)) FormName,                      
                      CAST('' AS NVARCHAR(200)) AS URL,                      
                      --CAST(0 AS INT) Sequence,                      
                      --URL,                      
                      Sequence,       
                      CAST(0 AS BIGINT) FormActionID,       
                      CAST('' AS NVARCHAR(150)) ActionName,       
                      CAST('' AS NVARCHAR(150)) EventName,       
                      CAST('' AS NVARCHAR(150)) DisplayName,       
                      CAST('' AS NVARCHAR(150)) DisplayNameAr,       
                      CAST('' AS NVARCHAR(150)) ActionType,       
                      NULL AS IsAPI,       
                      [Owin_FormInfo].IsView,       
                      [Owin_FormInfo].IsVisibleInMenu,       
                      CAST(0 AS BIGINT) RolePremissionID,       
                      CAST(1 AS BIT) AS STATUS,       
                      Ex_Nvarchar1,       
                      1,       
                      ClassIcon      
               FROM [dbo].[Owin_FormInfo]      
               WHERE(ISNULL(ParentID, 0) = 1      
                     OR [dbo].[Owin_FormInfo].AppFormID IN      
               (      
                   SELECT AppFormID      
                   FROM @vAppFormAll      
               ))      
               ORDER BY [Owin_FormInfo].parentid,       
                        [Owin_FormInfo].AppFormID;      
      
        -- Select * from @vMenu  where AppFormID in (40567)   ;                      
        -----------------------------------------------                    
      
        INSERT INTO @vMenu      
               SELECT owin_formaction.formactionid + 99000000 AS formactionid,       
                      dbo.owin_forminfo.formname,       
                      dbo.owin_forminfo.FormNameAr,       
                      dbo.owin_forminfo.appformid ParentID,       
                      dbo.owin_forminfo.url,       
                      dbo.owin_formaction.sequence,       
                      dbo.owin_formaction.formactionid,       
                      dbo.owin_formaction.actionname,       
                      dbo.owin_formaction.EventName,       
                      dbo.owin_formaction.DisplayName,       
                      dbo.owin_formaction.DisplayNameAr,       
                      owin_formaction.ActionType,       
                      owin_formaction.IsAPI,       
                      dbo.owin_formaction.isview,       
                      [Owin_FormInfo].IsVisibleInMenu,       
                      owin_rolepermission.rolepremissionid,       
                      ISNULL(owin_rolepermission.STATUS, 0) AS STATUS,       
                      Owin_FormAction.Ex_Nvarchar1,       
                      2,       
                      dbo.owin_formaction.ClassIcon      
               FROM dbo.owin_forminfo      
                    INNER JOIN dbo.owin_formaction ON owin_formaction.appformid = owin_forminfo.appformid      
                    INNER JOIN owin_rolepermission ON dbo.owin_formaction.formactionid = owin_rolepermission.formactionid      
               WHERE(CASE      
                         WHEN ISNULL(@MasterUserID, 0) = 0      
                         THEN 1      
                         WHEN ISNULL(@MasterUserID, 0) > 0      
                              AND (owin_rolepermission.roleid IN      
               (      
                   SELECT roleid      
                   FROM owin_userrole      
                   WHERE masteruserid = @MasterUserID      
               ))      
                         THEN 1      
                         ELSE 0      
                     END = 1)      
                    AND (CASE      
                             WHEN @UserId IS NULL      
                             THEN 1      
                             WHEN @UserId IS NOT NULL      
                                  AND (owin_rolepermission.roleid IN      
               (      
                   SELECT roleid      
                   FROM owin_userrole      
                   WHERE UserId = @UserId      
               ))      
                             THEN 1      
                             ELSE 0      
                         END = 1)      
               ORDER BY dbo.owin_forminfo.appformid,       
                        dbo.owin_formaction.sequence;      
      
        -----------------------------------------------                    
      
        WITH menu_cte      
             AS (SELECT vAction.appformid,       
                        CAST(vAction.formname AS NVARCHAR(100)) AS formname,       
                        CAST(vAction.FormNameAr AS NVARCHAR(100)) AS formnameAr,       
                        vAction.parentid,       
                        CAST(vAction.url AS NVARCHAR(200)) AS URL,       
                        vAction.sequence,       
                        vAction.formactionid,       
                        vAction.actionname,       
                        vAction.EventName,       
                        vAction.DisplayName,       
                        vAction.DisplayNameAr,       
                        vAction.ActionType,       
                        vAction.IsAPI,       
                        vAction.isview,       
                        vAction.IsVisibleInMenu,       
                        vAction.rolepremissionid,       
                        vAction.STATUS,       
                        vAction.Ex_Nvarchar1,       
                        vAction.MenuType,       
                        CAST('*' + CAST(vAction.appformid AS NVARCHAR(20)) + '*' AS NVARCHAR(300)) AS path,       
                        vAction.ClassIcon      
                 FROM @vMenu AS vAction      
                 WHERE ISNULL(ParentID, 0) = 1      
                 UNION ALL      
                 SELECT vAction1.appformid,       
                        CAST(vAction1.formname AS NVARCHAR(100)),       
                        CAST(vAction1.FormNameAr AS NVARCHAR(100)),       
                        vAction1.parentid,       
                        CAST(vAction1.url AS NVARCHAR(200)) AS URL,       
                        vAction1.sequence,       
                        vAction1.formactionid,       
                        vAction1.actionname,       
                        vAction1.EventName,       
                        vAction1.DisplayName,       
                        vAction1.DisplayNameAr,       
                        vAction1.ActionType,       
                        vAction1.IsAPI,      
                        (CASE      
                            WHEN ISNULL(menu_cte.isview, 0) = 0      
                            THEN CAST(0 AS BIT)      
                            ELSE vAction1.isview      
                        END) AS isview,       
      --vAction1.isview,      
                        (CASE      
                             WHEN ISNULL(menu_cte.IsVisibleInMenu, 0) = 0      
                             THEN CAST(0 AS BIT)      
                             ELSE vAction1.IsVisibleInMenu      
                         END) AS IsVisibleInMenu,       
       --vAction1.IsVisibleInMenu,      
                        vAction1.rolepremissionid,       
                        vAction1.STATUS,       
                        vAction1.Ex_Nvarchar1,       
                        vAction1.MenuType,       
                        CAST(Path + '.' + CAST('*' + CAST(vAction1.appformid AS NVARCHAR(20)) + '*' AS NVARCHAR(300)) AS NVARCHAR(300)),       
  vAction1.ClassIcon      
                 FROM @vMenu AS vAction1      
                      INNER JOIN menu_cte ON menu_cte.AppFormID = vAction1.ParentID      
                 WHERE vAction1.ParentID > 1)      
             INSERT INTO @vMenuDetl      
                    SELECT DISTINCT       
                           appformid,       
                           formname,       
                           formnameAr,       
                           parentid,       
                           url,       
                           sequence,       
                           formactionid,       
                           actionname,     
                           EventName,       
                           DisplayName,       
                           DisplayNameAr,       
                           ActionType,       
                           IsAPI,       
                           isview,       
                           IsVisibleInMenu,       
                           rolepremissionid,       
                           STATUS,       
                           Ex_Nvarchar1,       
                           MenuType,       
                           path,       
                           ClassIcon      
                    FROM menu_cte      
                    WHERE menu_cte.STATUS != 0;      
      
        ----------------------------------------------------------------                    
        --SELECT *                    
        --FROM @vMenuDetl                    
        --ORDER BY ParentID;                    
        -----------------------------------------------------------                    
        INSERT INTO @vMenuParentPath      
               SELECT DISTINCT       
                      Path      
               FROM @vMenuDetl      
               WHERE ParentID > 1      
                     AND IsView != 0      
                     AND ISNULL(STATUS, 0) = 1      
                     AND MenuType = 2  
      AND isnull(IsAPI,0) <> 1;--add by ron  
      
        ---------------------------------------------------------------                    
        --SELECT *                    
        --FROM @vMenuParentPath                    
        --WHERE path LIKE '%*10*%';                    
        ------------------------------------------------------------------------------------------                    
      --SELECT * FROM @vMenuDetl
        SELECT CASE      
                   WHEN MenuType = 1      
                   THEN appformid      
                   WHEN MenuType = 2      
                   THEN AppFormID - 99000000      
               END appformid,       
               formname,       
               FormNameAr,       
               parentid,       
               url,       
               sequence,       
               formactionid,       
               actionname,       
               EventName,       
               DisplayName,       
               DisplayNameAr,       
               ActionType,       
               IsAPI,       
               CAST(CASE      
                        WHEN MenuType = 1      
                             AND IsView = 1      
                        THEN CASE      
                                 WHEN ISNULL(      
        (      
            SELECT COUNT(*)      
            FROM @vMenuParentPath      
            WHERE path LIKE '%*' + CAST(AppFormID AS NVARCHAR(20)) + '*%'      
        ), 0) = 0      
                                 THEN 0      
                                 ELSE 1      
                             END      
                        WHEN MenuType = 1      
                             AND IsView = 0      
                        THEN IsView      
                        WHEN MenuType = 2      
                        THEN IsView      
                    END AS BIT) isview,       
               IsVisibleInMenu,       
               rolepremissionid,       
               STATUS,       
               Ex_Nvarchar1,       
               MenuType,       
               path,       
               ClassIcon      
   FROM @vMenuDetl                    
           Where                   
             isnull(IsView,0)= 1          
        and isnull(IsAPI,0) = 0 --or IsAPI is null)           
        ORDER BY ParentID,       
                 Sequence;      
    END; 
GO
