--[dbo].[Owin_ProcessGetFormActionList_Ext] @UserId='29640e6f-d66f-4d89-a249-013f05d9c9d6',@RoleID=12,@MasterUserID=122  
  
CREATE PROCEDURE [dbo].[Owin_ProcessGetFormActionList_Ext] @MasterUserID        BIGINT         = NULL,  
                @UserId              UNIQUEIDENTIFIER = NULL,   
                                                          @RoleID              BIGINT		= NULL,   
                                                          @Ex_Date1            DATETIME       = NULL,   
                                                          @Ex_Date2            DATETIME       = NULL,   
                                                          @Ex_Nvarchar1        NVARCHAR(250)  = NULL,   
                                                          @Ex_Nvarchar2        NVARCHAR(250)  = NULL,   
                                                          @Ex_Bigint1          BIGINT         = NULL,   
                                                          @Ex_Bigint2          BIGINT         = NULL,   
                                                          @Ex_Decimal1         DECIMAL(18, 2)  = NULL,   
                                                          @Ex_Decimal2         DECIMAL(18, 2)  = NULL,   
                                                          @SortExpression      VARCHAR(MAX)   = NULL,   
                                                          @CreatedBy           BIGINT         = NULL,   
                                                          @CreatedByUserName   NVARCHAR(256)  = NULL,   
                                                          @UpdatedBy           BIGINT         = NULL,   
                                                          @UpdatedByUserName   NVARCHAR(256)  = NULL,   
                                                          @CreatedDate         DATETIME       = NULL,   
                                                          @UpdatedDate         DATETIME       = NULL,   
                                                          @FormID              BIGINT         = NULL,   
                                                          @IPAddress           VARCHAR(100)   = NULL,   
                                                          @TransID             NVARCHAR(250)  = NULL,   
                                                          @UserOrganizationKey BIGINT         = NULL,   
                                                          @UserEntityKey       BIGINT         = NULL,   
                                                          @Ts                  BIGINT         = NULL  
AS  
    BEGIN  
        DECLARE @vMenu TABLE  
        (AppFormID     BIGINT NULL,   
         FormName      NVARCHAR(350) NULL,   
         FormNameAr    NVARCHAR(350) NULL,   
         ParentID      BIGINT NULL,   
         URL           NVARCHAR(350) NULL,   
         Sequence      INT NULL,   
         FormActionID  BIGINT NULL,   
         ActionName    NVARCHAR(350) NULL,   
         DisplayNameAr NVARCHAR(350) NULL,   
         ActionType       NVARCHAR(350) NULL,   
         IsAPI            BIT NULL,   
         EventName     NVARCHAR(350) NULL,   
         DisplayName   NVARCHAR(350) NULL,   
         IsView        BIT NULL,   
         STATUS        BIT NULL  
        );  
        INSERT INTO @vMenu  
               SELECT DISTINCT   
                      [dbo].[Owin_FormInfo].AppFormID,   
                      [dbo].[Owin_FormInfo].FormName,   
                      [dbo].[Owin_FormInfo].FormNameAr,   
                      ISNULL([dbo].[Owin_FormInfo].parentid, 0) ParentID,            
                      --       (CASE    
                      --            WHEN LevelID IN(1, 2)    
                      --            THEN ISNULL([dbo].[Owin_FormInfo].parentid, 0)    
                      --            ELSE    
                      --(    
                      --    SELECT A.ParentID    
                      --    FROM [Owin_FormInfo] AS A    
                      --    WHERE A.AppFormID = [Owin_FormInfo].parentid    
                    --)    
                      --        END) AS ParentID,     
                      CAST('' AS NVARCHAR(200)) AS URL,   
                      [Owin_FormInfo].Sequence,   
                      CAST(0 AS BIGINT) FormActionID,   
                      CAST('' AS NVARCHAR(150)) ActionName,   
                      CAST('' AS NVARCHAR(150)) DisplayNameAr,   
                      CAST('' AS NVARCHAR(150)) ActionType,   
                      NULL AS IsAPI,   
                      CAST('' AS NVARCHAR(150)) EventName,   
                      CAST('' AS NVARCHAR(150)) DisplayName,   
                      CAST(0 AS BIT) IsView,   
                      CAST(0 AS BIT) AS STATUS  
               FROM [dbo].[Owin_FormInfo]  
                    LEFT OUTER JOIN dbo.Owin_FormAction ON dbo.Owin_FormInfo.AppFormID = dbo.Owin_FormAction.AppFormID  
               WHERE (ISNULL(ParentID, 0) = 1    
                     --      OR AppFormID NOT IN    
                     --(    
                     --    SELECT ParentID    
                     --    FROM [Owin_FormInfo]    
                     --    WHERE LevelID = 2    
                     --)    
                     OR Owin_FormAction.AppFormID IS NOT NULL)  
      --and Owin_FormInfo.AppFormID not in (30238,40473);    
        --ORDER BY [Owin_FormInfo].parentid,     
        --         [Owin_FormInfo].AppFormID;    
  
        DECLARE @vParent TABLE  
        (AppFormID   BIGINT NULL,   
         OldParentID BIGINT NULL,   
         LevelID     BIGINT NULL,   
         NewParentID BIGINT NULL  
        );  
        WITH menu_cte  
             AS (SELECT AppFormID,   
                        ParentID,   
                        LevelID,   
                        vLevel = AppFormID  
                 FROM Owin_FormInfo  
                 WHERE ISNULL(ParentID, 0) = 1    
                 UNION ALL  
                 SELECT Owin_FormInfo.appformid,   
                        Owin_FormInfo.parentid,   
                        Owin_FormInfo.LevelID,   
                        vLevel = vLevel  
                 FROM Owin_FormInfo  
                      INNER JOIN menu_cte ON menu_cte.AppFormID = Owin_FormInfo.ParentID)  
             INSERT INTO @vParent  
                    SELECT DISTINCT   
                           AppFormID,   
                           ParentID,   
                           LevelID,   
                           vLevel  
                    FROM menu_cte;  
        UPDATE @vMenu  
          SET   
              ParentID = t2.NewParentID  
        FROM @vMenu t1  
             INNER JOIN @vParent t2 ON t1.AppFormID = t2.AppFormID  
        WHERE ISNULL(t1.ParentID, 0) <> 1;  
        INSERT INTO @vMenu  
               SELECT 0 AS appformid,   
                      dbo.owin_forminfo.formname,   
                      dbo.owin_forminfo.FormNameAr,   
                      dbo.owin_forminfo.appformid ParentID,   
                      dbo.owin_forminfo.url,   
                      dbo.owin_forminfo.sequence,   
                      dbo.owin_formaction.formactionid,   
                      dbo.owin_formaction.actionname,   
                      dbo.owin_formaction.DisplayNameAr,   
                      owin_formaction.ActionType,   
                      NULL AS IsAPI,   
                      dbo.owin_formaction.EventName,   
                      owin_formaction.DisplayName,   
                      dbo.owin_formaction.isview,   
                      ISNULL(owin_rolepermission.STATUS, 0) AS STATUS  
               FROM dbo.owin_forminfo  
                    INNER JOIN dbo.owin_formaction ON owin_formaction.appformid = owin_forminfo.appformid  
                    LEFT OUTER JOIN  
               (  
                   SELECT *  
                   FROM dbo.Owin_RolePermission  
                   WHERE ISNULL(Owin_RolePermission.RoleID, 0) = @RoleID  
               ) AS Owin_RolePermission ON dbo.Owin_FormAction.FormActionID = Owin_RolePermission.FormActionID            
               --INNER JOIN owin_rolepermission ON dbo.owin_formaction.formactionid = owin_rolepermission.formactionid            
               WHERE (CASE  
                         WHEN @UserID is null   
                         THEN 1  
                         WHEN @UserID is not null   
                              AND (owin_rolepermission.roleid IN  
               (  
                   SELECT roleid  
                   FROM owin_userrole  
                   WHERE UserID = @UserID  
               ))  
                         THEN 1  
                         ELSE 0  
                     END = 1)  
                    AND (CASE  
                         WHEN ISNULL(@MasterUserID, 0) = 0  
                         THEN 1  
                         WHEN ISNULL(@MasterUserID, 0) > 0  
                              AND (owin_rolepermission.roleid IN  
               (  
                   SELECT roleid  
                   FROM owin_userrole  
                   WHERE masteruserid = @MasterUserID  
               ))  
                         THEN 1  
                         ELSE 0  
                     END = 1)  
                     AND dbo.owin_formaction.EventName <> 'Internal Method';          
        --  AND isnull(Owin_FormAction.IsView, 0) = 1;       
  
  
        --  SELECT *    
        --FROM @vMenu;    
  
        SELECT Menu.AppFormID,   
               FormName,   
               FormNameAr,   
               ParentID,   
               URL,   
               Sequence,   
               FormActionID,   
               ActionName,   
               DisplayNameAr,   
               ActionType,   
                        IsAPI,   
                        EventName,   
               DisplayName,   
               IsView,   
               STATUS  
        FROM @vMenu AS Menu    
  where (IsAPI = 0 or IsAPI is null)  
        --LEFT OUTER JOIN @vParent Parent ON Menu.ParentID = Parent.AppFormID    
        ORDER BY Menu.parentid,   
                 Menu.AppFormID;    
        --SELECT *    
        --FROM @vMenu;    
    END;
GO
