CREATE PROCEDURE [dbo].[owin_role_Ins_ext] @RoleID              BIGINT         = NULL, 
                                          @RoleName            NVARCHAR(250)  = NULL,
										  @IsActive			   BIT			  = NULL,
                                          @Description         NVARCHAR(500)  = NULL, 
                                          @CopyFromRoleID      BIGINT         = NULL, 
                                          @Ex_Date1            DATETIME       = NULL, 
                                          @Ex_Date2            DATETIME       = NULL, 
                                          @Ex_Nvarchar1        NVARCHAR(250)  = NULL, 
                                          @Ex_Nvarchar2        NVARCHAR(250)  = NULL, 
                                          @Ex_Bigint1          BIGINT         = NULL, 
                                          @Ex_Bigint2          BIGINT         = NULL, 
                                          @Ex_Decimal1         DECIMAL(18, 2)  = NULL, 
                                          @Ex_Decimal2         DECIMAL(18, 2)  = NULL, 
                                          @RETURN_KEY          BIGINT         = NULL OUTPUT, 
                                          @CreatedBy           BIGINT= NULL, 
                                          @CreatedByUserName   NVARCHAR(256), 
                                          @UpdatedBy           BIGINT         = NULL, 
                                          @UpdatedByUserName   NVARCHAR(256)  = NULL, 
                                          @CreatedDate         DATETIME= NULL, 
                                          @UpdatedDate         DATETIME       = NULL, 
                                          @FormID              BIGINT= NULL, 
                                          @IPAddress           NVARCHAR(150)   = NULL, 
                                          @TransID             NVARCHAR(250), 
                                          @UserOrganizationKey BIGINT= NULL, 
                                          @UserEntityKey       BIGINT= NULL, 
                                          @Ts                  BIGINT         = NULL
AS
    BEGIN
        INSERT INTO Owin_Role
        (RoleName, 
		 IsActive,
         Description,  
         TransID, 
         CreatedByUserName, 
         CreatedDate, 
         IPAddress
        )
        VALUES
        (@RoleName,
		 @IsActive,
         @Description, 
         @TransID, 
         @CreatedByUserName, 
         @CreatedDate, 
         @IPAddress
        );
        SET @RETURN_KEY = SCOPE_IDENTITY();

		----------

        IF ISNULL(@CopyFromRoleID, 0) = 0
            BEGIN
                INSERT INTO Owin_RolePermission
                (RoleID, 
                 FormActionID, 
                 AppFormID, 
                 STATUS, 
                  
                 TransID, 

                 CreatedByUserName, 
                 CreatedDate, 
                 IPAddress
                )
                       SELECT @RETURN_KEY, 
                              Owin_FormAction.FormActionID, 
                              Owin_FormAction.AppFormID,
                              CASE
                                  WHEN LTRIM(RTRIM(Owin_FormAction.EventName)) = LTRIM(RTRIM('Internal Method'))
                                  THEN 1
                                  ELSE 0
                              END, --Modified on 14th Oct 2019 & Requested By Eyasin  
                              @TransID, 
                              @CreatedByUserName, 
                              @CreatedDate, 
                              @IPAddress
                       FROM Owin_FormAction;
        END;
            ELSE
            BEGIN
                INSERT INTO Owin_RolePermission
                (RoleID, 
                 FormActionID, 
                 AppFormID, 
                 STATUS,  
                 TransID, 
                 CreatedByUserName, 
                 CreatedDate, 
                 IPAddress
                )
                       SELECT @RETURN_KEY, 
                              Owin_RolePermission.FormActionID, 
                              Owin_RolePermission.AppFormID,
                              Owin_RolePermission.Status, --Modified on 14th Oct 2019 & Requested By Eyasin   
                              @TransID, 
                              @CreatedByUserName, 
                              @CreatedDate, 
                              @IPAddress
                       FROM Owin_RolePermission
					   where RoleID=@CopyFromRoleID;
        END;
    END;
