   IsActive = @IsActive,
   Description = @Description,    
   --Ex_Date1 = @Ex_Date1,    
   --Ex_Date2 = @Ex_Date2,    
   --Ex_Nvarchar1 = @Ex_Nvarchar1,    
   --Ex_Nvarchar2 = @Ex_Nvarchar2,    
   --Ex_Bigint1 = @Ex_Bigint1,    
   --Ex_Bigint2 = @Ex_Bigint2,    
   --Ex_Decimal1 = @Ex_Decimal1,    
   --Ex_Decimal2 = @Ex_Decimal2,    
   TransID = @TransID,    
   --UserOrganizationKey = @UserOrganizationKey,    
   --UserEntityKey = @UserEntityKey,    
   --UpdatedBy = @UpdatedBy,    
   UpdatedByUserName = @UpdatedByUserName,    
   UpdatedDate = @UpdatedDate,    
   IPAddress = @IPAddress    
   --FormID = @FormID    
  WHERE    
   RoleID = @RoleID    
    
 SET @RETURN_KEY =@RoleID    
    
  INSERT INTO Owin_RolePermission    
           (RoleID    
           ,FormActionID    
           ,AppFormID    
           ,Status    
           --,Ex_Date1    
           --,Ex_Date2    
           --,Ex_Nvarchar1    
           --,Ex_Nvarchar2    
           --,Ex_Bigint1    
           --,Ex_Bigint2    
           --,Ex_Decimal1    
           --,Ex_Decimal2    
           ,TransID    
           --,UserOrganizationKey    
           --,UserEntityKey    
           --,CreatedBy    
           ,CreatedByUserName    
           ,CreatedDate    
           ,IPAddress    
           --,FormID
		   )    
   select    
           @RETURN_KEY,    
   Owin_FormAction.FormActionID,    
   Owin_FormAction.AppFormID,    
 (CASE WHEN   
 LTRIM(RTRIM(Owin_FormAction.EventName)) = LTRIM(RTRIM('Internal Method')) THEN  
 1 ELSE 0 END) AS Status, --Modified on 14th Oct 2019 & Requested By Eyasin ,    
   --@Ex_Date1,    
   --@Ex_Date2,    
   --@Ex_Nvarchar1,    
   --@Ex_Nvarchar2,    
   --@Ex_Bigint1,    
   --@Ex_Bigint2,    
   --@Ex_Decimal1,    
   --@Ex_Decimal2,    
   @TransID,    
   --@UserOrganizationKey,    
   --@UserEntityKey,    
   --@CreatedBy,    
   @CreatedByUserName,    
   @CreatedDate,    
   @IPAddress   
   --@FormID    
  from Owin_FormAction    
  where Owin_FormAction.FormActionID not in (select Owin_RolePermission.FormActionID   
            from Owin_RolePermission where RoleID = @RoleID)    
    
    
  UPDATE Owin_RolePermission  
  SET Status=1  
  WHERE FormActionID IN (SELECT FormActionID FROM Owin_FormAction  
       WHERE LTRIM(RTRIM(Owin_FormAction.EventName)) = LTRIM(RTRIM('Internal Method'))  
       )  
  AND RoleID = @RoleID    
          
 END     
    
    
